const node_contents_27 = "Asigno window.$translations como {\n    \"es\": {\n        \"add\": \"añadir\",\n        \"edit\": \"editar\"\n    },\n    \"en\": {\n        \"Economía algorítmica\": \"Algorythmic economy\",\n        \"Inicio\": \"Home\",\n        \"Identificación\": \"Identification\",\n        \"Productos\": \"Products\",\n        \"Tecnologías\": \"Technologies\",\n        \"Consumidores\": \"Consumers\",\n        \"Sucursales\": \"Sucursals\",\n        \"Operaciones\": \"Operations\",\n        \"Estrategia\": \"Strategy\",\n        \"Idioma\": \"Language\",\n        \"Idioma:\": \"Language:\",\n        \"Identificarse\": \"Login\",\n        \"Usuario:\": \"User:\",\n        \"Contraseña:\": \"Password:\",\n        \"Sesión\": \"Session\",\n        \"Configuraciones\": \"Configurations\",\n        \"Atrás\": \"Back\",\n        \"Datos\": \"Data\",\n        \"Autentificación\": \"Authentification\",\n        \"Proyecto:\": \"Project:\",\n        \"add\": \"add\",\n        \"edit\": \"edit\"\n    },\n    \"ca\": {\n        \"Economía algorítmica\": \"Economia algorítmica\",\n        \"Inicio\": \"Inici\",\n        \"Identificación\": \"Identificació\",\n        \"Productos\": \"Productes\",\n        \"Tecnologías\": \"Tecnologies\",\n        \"Consumidores\": \"Consumidors\",\n        \"Sucursales\": \"Sucursals\",\n        \"Operaciones\": \"Operacions\",\n        \"Estrategia\": \"Estratègia\",\n        \"Idioma\": \"Idioma\",\n        \"Idioma:\": \"Idioma:\",\n        \"Identificarse\": \"Identificar-se\",\n        \"Usuario:\": \"Usuari:\",\n        \"Contraseña:\": \"Contrasenya:\",\n        \"Sesión\": \"Sessió\",\n        \"Configuraciones\": \"Configuracions\",\n        \"Atrás\": \"Enrere\",\n        \"Datos\": \"Dades\",\n        \"Autentificación\": \"Autentificació\",\n        \"Proyecto:\": \"Projecte:\",\n        \"add\": \"afegir\",\n        \"edit\": \"editar\"\n    }\n}.\n";
