const node_36 = path.resolve(baseDirectory, ".", "src", "app.js");
const node_contents_36 = "const fs = require(\"fs\");\nconst url = require(\"url\");\nconst path = require(\"path\");\n\nconst staticPath = __dirname + \"/app\";\nconst dispatchStaticResources = function(request, response) {\n    const parsedURL = url.parse(request.url, true);\n    let relativePath = parsedURL.path.replace(\"/app\", \"\");\n    if ((relativePath === \"\") || (relativePath === \"/\")) {\n        relativePath = \"/index.html\";\n    }\n    if ((relativePath.indexOf(\"..\") !== -1) && (relativePath.indexOf(\"&\") !== -1)) {\n        response.setHeader(\"Content-type\", \"text/plain\");\n        response.write(\"The expression '..' and '&' are never allowed for static requests.\");\n        return response.end();\n    }\n    const targetPath = staticPath + relativePath;\n    if(targetPath.startsWith(\"\")) {\n        \n    }\n    console.log(\"Requested file: \" + targetPath);\n    if(targetPath.endsWith(\".json\")) {\n        response.setHeader(\"Content-type\", \"application/json\");\n    }\n    const stream = fs.createReadStream(targetPath);\n    stream.on(\"error\", function () {\n        response.setHeader(\"Content-type\", \"text/plain\");\n        response.write(\"The requested file was not found.\");\n        return response.end();\n    });\n    return stream.pipe(response);\n};\n\nmodule.exports = (async function () {\n    try {\n        return await new Promise(function(ok) {\n            const server = require(\"http\").createServer(dispatchStaticResources);\n            const settings = require(__dirname + \"/security/settings.json\");\n            server.listen(settings.APPLICATION_PORT, function() {\n                console.log(\"App listening on:\");\n                console.log(\"  » \" + settings.SERVER_PROTOCOL + \"://\" + settings.SERVER_HOST + \":\" + settings.APPLICATION_PORT);\n                return ok({ server, settings, directory: path.resolve(__dirname + \"/..\") });\n            });\n        });\n    } catch (error) {\n        console.log(\"Error on start:\", error.name, error.message, error.stack);\n        return error;\n    }\n})();";
fs.writeFileSync(node_36, node_contents_36, "utf8");

const node_37 = path.resolve(baseDirectory, ".", "src", "chat.js");
const node_contents_37 = "module.exports = (async function () {\n    try {\n        return await new Promise(function (ok) {\n            const utils = require(__dirname + \"/classes/Utils.js\");\n            const server = require(\"http\").createServer((request, response) => {\n                response.writeHead(200, { \"Content-type\": \"text/plain\" });\n                response.write(\"This is the endpoint of a chat app for restologia apps\");\n                response.end();\n            });\n            const settings = require(__dirname + \"/security/settings.json\");\n            const socketIO = require(\"socket.io\");\n            const chatsSocket = new socketIO.Server(server, {\n                cors: {\n                    origin: [\"*\"],\n                    credentials: false\n                }\n            });\n            chatsSocket.on(\"connection\", emitterSocket => {\n                try {\n                    emitterSocket.on(\"disconnect\", async () => {\n                        try {\n                            chatsSocket.emit(\"nativo:mensaje de chat\", {\n                                emisor: \"!\",\n                                mensaje: \"Identidad con alias «x» se desconectó\"\n                            });\n                        } catch(error) {\n                            utils.debugError(\"emitterSocket.on:disconnect\", error, false);\n                        }\n                    });\n                } catch (error) {\n                    utils.debugError(\"chatsSocket.on:connect\", error, false);\n                }\n            });\n            server.listen(settings.CHAT_PORT, function () {\n                console.log(\"Chat listening on:\");\n                console.log(\"  » \" + settings.SERVER_PROTOCOL + \"://\" + settings.SERVER_HOST + \":\" + settings.APPLICATION_PORT);\n                return ok({ server, settings, directory: path.resolve(__dirname + \"/..\") });\n            });\n        });\n    } catch (error) {\n        console.log(\"Error on start:\", error.name, error.message, error.stack);\n        return error;\n    }\n})();";
fs.writeFileSync(node_37, node_contents_37, "utf8");

