const node_43 = path.resolve(baseDirectory, ".", "src", "classes", "auth", "Authentication.js");
const node_contents_43 = "class Authentication {\n\n    constructor(environment, project) {\n        this.environment = environment;\n        this.project = project;\n        this.credentials = undefined;\n        this.session = undefined;\n        this.user = undefined;\n        this.groups = undefined;\n        this.privileges = undefined;\n    }\n\n    setCredentials(userOrEmail, password) {\n        this.environment.utils.trace(\"Authentication.setCredentials\");\n        this.credentials = [userOrEmail, password ];\n    }\n\n    setUser(user) {\n        this.environment.utils.trace(\"Authentication.setUser\");\n        this.user = user;\n    }\n\n    setGroups(groups) {\n        this.environment.utils.trace(\"Authentication.setGroups\");\n        this.groups = groups;\n    }\n\n    setPrivileges(privileges) {\n        this.environment.utils.trace(\"Authentication.setPrivileges\");\n        this.privileges = privileges;\n    }\n\n    setSession(session) {\n        this.environment.utils.trace(\"Authentication.setSession\");\n        this.session = session;\n    }\n\n    toPlainObject() {\n        const sanitizedUser = Object.assign({}, this.user);\n        const sanitizedSession = Object.assign({}, this.session);\n        delete sanitizedUser.password;\n        delete sanitizedSession.token;\n        return {\n            project: this.project,\n            session: sanitizedSession,\n            user: sanitizedUser,\n            groups: this.groups,\n            privileges: this.privileges,\n        };\n    }\n\n}\n\nmodule.exports = Authentication;";
fs.writeFileSync(node_43, node_contents_43, "utf8");

const node_44 = path.resolve(baseDirectory, ".", "src", "classes", "auth", "Authenticator.js");
const node_contents_44 = "class Authenticator {\n\n    constructor(environment, project) {\n        this.environment = environment;\n        this.project = project;\n    }\n\n    async authenticate(token) {\n        try {\n            this.environment.utils.trace(\"Authenticator.authenticate\");\n            const authentication = new this.environment.auth.Authentication(this.environment, this.project);\n            const { projectData } = await this.environment.database.Project.initialize(this.project, \"authenticate\");\n            ////////////////////////////////\n            // 1.2.A. Respond by externalized auth system:\n            if(this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"attributes\", \"isAuthenticatedBy\"]).isObject()) {\n                const { url: authURL, project: authProjectId } = projectData.schema.attributes.isAuthenticatedBy;\n                const response = await this.environment.server.Requester.request(\"GET\", authURL, {\n                    project: authProjectId,\n                    operation: \"authenticate\"\n                }, {}, {\n                    authorization: token\n                }, false, false);\n                if (response.response.status === \"error\") {\n                    throw new Error(response.response.error.message);\n                }\n                authentication.setSession(response.response.data.authentication.session);\n                authentication.setUser(response.response.data.authentication.user);\n                authentication.setGroups(response.response.data.authentication.groups);\n                authentication.setPrivileges(response.response.data.authentication.privileges);\n                return authentication;\n            }\n            ////////////////////////////////\n            // 1.2.B. Respond by self auth system:\n            const usersPath = this.environment.utils.resolveFromSrc(\"data/projects/\" + this.project + \"/data/users.json\");\n            const sessionsPath = this.environment.utils.resolveFromSrc(\"data/projects/\" + this.project + \"/data/sessions.json\");\n            const groupsPath = this.environment.utils.resolveFromSrc(\"data/projects/\" + this.project + \"/data/groups.json\");\n            const privilegesPath = this.environment.utils.resolveFromSrc(\"data/projects/\" + this.project + \"/data/privileges.json\");\n            // Sessions:\n            const sessions = await this.environment.utils.hydrateJSON(sessionsPath);\n            const matchedSessions = Object.values(sessions.data).filter(session => session.token === token);\n            if (matchedSessions.length === 0) {\n                throw new Error(\"Authentication token is not valid on authentication process\");\n            }\n            const [matchedSession] = matchedSessions;\n            // Users:\n            const users = await this.environment.utils.hydrateJSON(usersPath);\n            const matchedUsers = Object.values(users.data).filter(user => user.id === matchedSession.user);\n            if (matchedUsers.length !== 1) {\n                throw new Error(\"Session token does not correspond to any valid user\");\n            }\n            const [matchedUser] = matchedUsers;\n            // Groups:\n            const groups = await this.environment.utils.hydrateJSON(groupsPath);\n            const matchedGroups = matchedUser.groups.map(groupId => groups.data[groupId]);\n            // Privileges:\n            const privileges = await this.environment.utils.hydrateJSON(privilegesPath);\n            const matchedPrivilegesMap = matchedUser.privileges.reduce((output, privilegeId) => {\n                output[privilegeId] = privileges.data[privilegeId];\n                return output;\n            }, {});\n            matchedGroups.forEach(group => {\n                group.privileges.forEach(privilegeId => {\n                    const matchedPrivilege = privileges.data[privilegeId];\n                    matchedPrivilegesMap[privilegeId] = matchedPrivilege;\n                });\n            });\n            const matchedPrivileges = Object.values(matchedPrivilegesMap);\n            // Fill authentication:\n            authentication.setSession(matchedSession);\n            authentication.setUser(matchedUser);\n            authentication.setGroups(matchedGroups);\n            authentication.setPrivileges(matchedPrivileges);\n            // Return authentication:\n            return authentication;\n        } catch(error) {\n            this.environment.utils.debugError(\"Authenticator.authenticate\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = Authenticator;";
fs.writeFileSync(node_44, node_contents_44, "utf8");

const node_45 = path.resolve(baseDirectory, ".", "src", "classes", "auth", "Authorization.js");
const node_contents_45 = "class Authorization {\n\n    constructor(environment, project, authentication) {\n        this.environment = environment;\n        this.project = project;\n        this.authentication = authentication;\n    }\n\n    isAuthorizedToSelect(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    isAuthorizedToInsert(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    isAuthorizedToUpdate(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    isAuthorizedToDelete(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    isAuthorizedToAddTable(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToAddColumn(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToAddProtector(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToUpdateTable(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToUpdateColumn(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToUpdateProtector(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToDeleteTable(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToDeleteColumn(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToDeleteProtector(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return this.authentication.privileges.filter(privilege => privilege.name === \"to administrate\").length > 0;\n    }\n\n    isAuthorizedToLogin(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    isAuthorizedToLogout(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    isAuthorizedToViewSchema(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    isAuthorizedToViewProtectors(operation, table, ...parameters) {\n        // @TOCUSTOMIZE:\n        return true;\n    }\n\n    \n    async forOperation(operation, table, ...parameters) {\n        try {\n            this.environment.utils.trace(\"Authorization.forOperation\");\n            switch(operation) {\n                case \"select\": return this.isAuthorizedToSelect(operation, table, ...parameters);\n                case \"insert\": return this.isAuthorizedToInsert(operation, table, ...parameters);\n                case \"update\": return this.isAuthorizedToUpdate(operation, table, ...parameters);\n                case \"delete\": return this.isAuthorizedToDelete(operation, table, ...parameters);\n                case \"add-table\": return this.isAuthorizedToAddTable(operation, table, ...parameters);\n                case \"add-column\": return this.isAuthorizedToAddColumn(operation, table, ...parameters);\n                case \"add-protector\": return this.isAuthorizedToAddProtector(operation, table, ...parameters);\n                case \"update-table\": return this.isAuthorizedToUpdateTable(operation, table, ...parameters);\n                case \"update-column\": return this.isAuthorizedToUpdateColumn(operation, table, ...parameters);\n                case \"update-protector\": return this.isAuthorizedToUpdateProtector(operation, table, ...parameters);\n                case \"delete-table\": return this.isAuthorizedToDeleteTable(operation, table, ...parameters);\n                case \"delete-column\": return this.isAuthorizedToDeleteColumn(operation, table, ...parameters);\n                case \"delete-protector\": return this.isAuthorizedToDeleteProtector(operation, table, ...parameters);\n                case \"login\": return this.isAuthorizedToLogin(operation, table, ...parameters);\n                case \"logout\": return this.isAuthorizedToLogout(operation, table, ...parameters);\n                case \"view-schema\": return this.isAuthorizedToViewSchema(operation, table, ...parameters);\n                case \"view-protectors\": return this.isAuthorizedToViewProtectors(operation, table, ...parameters);\n                default: return true;\n            }\n        } catch(error) {\n            this.environment.utils.debugError(\"Authorization.forOperation\", error, true);\n        }\n    }\n}\n\nmodule.exports = Authorization;";
fs.writeFileSync(node_45, node_contents_45, "utf8");

