const node_48 = path.resolve(baseDirectory, ".", "src", "classes", "database", "AddColumn.js");
const node_contents_48 = "\n\nclass AddColumn {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"AddColumn.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «add-column»\");\n            }\n            // @TODO: apply protectors\n            const { table, column, attributes: attributesOriginal = \"{}\", properties: propertiesOriginal = \"{}\" } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-row»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «add-column»\");\n            }\n            if (!this.environment.utils.check.that(column).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «column» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «add-column»\");\n            }\n            if (!this.environment.utils.check.that(attributesOriginal).isString()) {\n                throw new Error(\"Parameter «attributes» must be a string or omitted in order to «add-column»\");\n            }\n            if (!this.environment.utils.check.that(propertiesOriginal).isString()) {\n                throw new Error(\"Parameter «properties» must be a string or omitted in order to «add-column»\");\n            }\n            const attributes = JSON.parse(attributesOriginal);\n            const properties = JSON.parse(propertiesOriginal);\n            if (!this.environment.utils.check.that(attributes).isObject()) {\n                throw new Error(\"Parameter «attributes» must be a JSON object or omitted in order to «add-column»\");\n            }\n            if (!this.environment.utils.check.that(properties).isObject()) {\n                throw new Error(\"Parameter «properties» must be a JSON object or omitted in order to «add-column»\");\n            }\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"add-column\");\n                    if (!(table in projectData.schema.tables)) {\n                        throw new Error(\"Parameter «table» must exist as table in schema in order to «add-column»\");\n                    }\n                    if (column in projectData.schema.tables[table].columns) {\n                        throw new Error(\"Parameter «column» must not exist as column in schema in order to «add-column»\");\n                    }\n                    projectData.schema.tables[table].columns[column] = {\n                        attributes: Object.assign({}, this.environment.database.constructor.DEFAULT_COLUMN_ATTRIBUTES, attributes),\n                        properties: Object.assign({}, this.environment.database.constructor.DEFAULT_COLUMN_PROPERTIES, properties),\n                    };\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «add-column» successfully achieved\", table, column };\n        } catch (error) {\n            this.environment.utils.debugError(\"AddColumn.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = AddColumn;";
fs.writeFileSync(node_48, node_contents_48, "utf8");

const node_49 = path.resolve(baseDirectory, ".", "src", "classes", "database", "AddProtector.js");
const node_contents_49 = "class AddProtector {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"AddProtector.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «add-protector»\");\n            }\n            // @TODO: apply protectors\n            const { table } = privateParameters;\n            const { protector_type, protector_name, parameters: parametersOriginal } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «add-protector»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «add-protector»\");\n            }\n            if (!this.environment.utils.check.that(parametersOriginal).isString()) {\n                throw new Error(\"Parameter «parameters» must be a string in order to «add-protector»\");\n            }\n            if (!this.environment.utils.check.that(protector_type).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «protector_type» must be a string based only on letters, numbers, '.', '-' and '_' in order to «add-protector»\");\n            }\n            if (!this.environment.utils.check.that(protector_name).isString()) {\n                throw new Error(\"Parameter «protector_name» must be a string in order to «add-protector»\");\n            }\n            const parameters = JSON.parse(parametersOriginal);\n            if (!this.environment.utils.check.that(parameters).isObject()) {\n                throw new Error(\"Parameter «parameters» must be a JSON object in order to «add-protector»\");\n            }\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"update-table\");\n                    if (!(table in projectData.schema.tables)) {\n                        throw new Error(\"Parameter «table» must exist as table in schema in order to «add-protector»\");\n                    }\n                    const tableProtectors = projectData.schema.tables[table].attributes.hasProtectors || [];\n                    const coincidingProtectors = tableProtectors.filter(protector => protector.name === protector_name);\n                    if (!this.environment.utils.check.that(coincidingProtectors.length).equals(0)) {\n                        throw new Error(\"Parameter «protector_name» must be unique as table protector name in order to «add-protector»\");\n                    }\n                    const availableProtectorIdsBrute = await this.environment.utils.listDirectory(__dirname + \"/protectors\");\n                    const availableProtectorIds = availableProtectorIdsBrute.filter(protector => protector.endsWith(\".js\")).map(protector => protector.replace(/\\.js$/g, \"\"));\n                    if (availableProtectorIds.indexOf(protector_type) === -1) {\n                        throw new Error(\"Parameter «parameter_type» must match a valid protector type in order to «add-protector»\");\n                    }\n                    const protectorClass = require(__dirname + \"/protectors/\" + protector_type + \".js\");\n                    await protectorClass.checkSettings(parameters, projectData, table, \"add-protector\");\n                    if (!(\"hasProtectors\" in projectData.schema.tables[table].attributes)) {\n                        projectData.schema.tables[table].attributes.hasProtectors = [];\n                    }\n                    projectData.schema.tables[table].attributes.hasProtectors.push({\n                        id: protector_type,\n                        fixed: false,\n                        name: protector_name,\n                        parameters,\n                    });\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «add-protector» successfully achieved\", project };\n        } catch (error) {\n            this.environment.utils.debugError(\"AddProtector.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = AddProtector;";
fs.writeFileSync(node_49, node_contents_49, "utf8");

const node_50 = path.resolve(baseDirectory, ".", "src", "classes", "database", "AddTable.js");
const node_contents_50 = "class AddTable {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"AddTable.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «add-table»\");\n            }\n            // @TODO: apply protectors\n            const { table, attributes: attributesOriginal = \"{}\", properties: propertiesOriginal = \"{}\", columns: columnsOriginal = \"{}\" } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-row»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «add-table»\");\n            }\n            if (!this.environment.utils.check.that(attributesOriginal).isString()) {\n                throw new Error(\"Parameter «attributes» must be a string or omitted in order to «add-table»\");\n            }\n            if (!this.environment.utils.check.that(propertiesOriginal).isString()) {\n                throw new Error(\"Parameter «properties» must be a string or omitted in order to «add-table»\");\n            }\n            if (!this.environment.utils.check.that(columnsOriginal).isString()) {\n                throw new Error(\"Parameter «columns» must be a string or omitted in order to «add-table»\");\n            }\n            const attributes = JSON.parse(attributesOriginal);\n            const properties = JSON.parse(propertiesOriginal);\n            const allColumns = JSON.parse(columnsOriginal);\n            if (!this.environment.utils.check.that(attributes).isObject()) {\n                throw new Error(\"Parameter «attributes» must be a JSON object or omitted in order to «add-table»\");\n            }\n            if (!this.environment.utils.check.that(properties).isObject()) {\n                throw new Error(\"Parameter «properties» must be a JSON object or omitted in order to «add-table»\");\n            }\n            if (!this.environment.utils.check.that(allColumns).isObject()) {\n                throw new Error(\"Parameter «columns» must be a JSON object or omitted in order to «add-table»\");\n            }\n            const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"add-table\");\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    if(table in projectData.schema.tables) {\n                        throw new Error(\"Parameter «table» must not exist as table in schema in order to «add-table»\");\n                    }\n                    const finalColumns = {};\n                    const allColumnIds = Object.keys(allColumns);\n                    for (let indexColumns = 0; indexColumns < allColumnIds.length; indexColumns++) {\n                        const columnId = allColumnIds[indexColumns];\n                        if (!this.environment.utils.check.that(columnId).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                            throw new Error(\"Parameter «column» on index «\" + columnId + \"» must be keyed as a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «add-table»\");\n                        }\n                        const column = allColumns[columnId];\n                        if(!this.environment.utils.check.that(column).isObject()) {\n                            throw new Error(\"Parameter «columns» on index «\" + columnId + \"» must be an object in order to «add-table»\");\n                        }\n                        finalColumns[columnId] = {\n                            attributes: Object.assign({}, this.environment.database.constructor.DEFAULT_COLUMN_ATTRIBUTES, column.attributes || {}),\n                            properties: Object.assign({}, this.environment.database.constructor.DEFAULT_COLUMN_PROPERTIES, column.properties || {}),\n                        };\n                    }\n                    projectData.schema.tables[table] = {\n                        attributes: Object.assign({}, this.environment.database.constructor.DEFAULT_TABLE_ATTRIBUTES, attributes),\n                        properties: Object.assign({}, this.environment.database.constructor.DEFAULT_TABLE_PROPERTIES, properties),\n                        columns: finalColumns\n                    };\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    unblock();\n                } catch(error) {\n                    unblockFailing(error);\n                }\n            });\n            // @NOTE: no need to block because this file does not exist yet here:\n            const tablePath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/\" + table + \".json\");\n            await this.environment.utils.dehydrateJSON(tablePath, { id: 1, data: {} });\n            // @TODO: apply triggers\n            return { message: \"Operation «add-table» successfully achieved\", table };\n        } catch (error) {\n            this.environment.utils.debugError(\"AddTable.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = AddTable;";
fs.writeFileSync(node_50, node_contents_50, "utf8");

