const node_52 = path.resolve(baseDirectory, ".", "src", "classes", "database", "CreateProject.js");
const node_contents_52 = "class CreateProject {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"CreateProject.execute\");\n            ////////////////////////////////\n            // 1. Authorize operation:\n            const user = this.environment.settings.ADMINISTRATOR_USER;\n            const password = this.environment.settings.ADMINISTRATOR_PASSWORD;\n            if(privateParameters.user !== user) {\n                throw new Error(\"Specified user does not correspond to administrator in order to «create-project»\");\n            }\n            if(privateParameters.password !== password) {\n                throw new Error(\"Specified password does not correspond to administrator in order to «create-project»\");\n            }\n            ////////////////////////////////\n            // 2. Execute operation:\n            ////////////////////////////////\n            // 2.1. Validate parameters\n            const project = privateParameters.project;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «create-project»\");\n            }\n            const { projectPath } = new this.environment.database.Project(project, \"create-project\");\n            const projectDirectory = require(\"path\").dirname(projectPath);\n            const projectExists = await this.environment.utils.fileExists(projectDirectory);\n            if(projectExists) {\n                throw new Error(\"Project «\" + project + \"» cannot be created because it already exists\");\n            }\n            ////////////////////////////////\n            // 2.2. Copy & Paste defaults with proper alterations\n            const projectOriginFile = __dirname + \"/defaults/project.json\";\n            const projectData = await this.environment.utils.hydrateJSON(projectOriginFile);\n            const projectDataDirectory = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data\");\n            const projectFilesDirectory = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/files\");\n            const sessionsDestinationFile = projectDataDirectory + \"/sessions.json\";\n            const usersDestinationFile = projectDataDirectory + \"/users.json\";\n            const groupsDestinationFile = projectDataDirectory + \"/groups.json\";\n            const privilegesDestinationFile = projectDataDirectory + \"/privileges.json\";\n            await this.environment.utils.createDirectory(projectDirectory);\n            await this.environment.utils.createDirectory(projectDataDirectory);\n            await this.environment.utils.createDirectory(projectFilesDirectory);\n            if(privateParameters.schema_attributes) {\n                Object.assign(projectData.schema.attributes, privateParameters.schema_attributes);\n            }\n            if (!this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"attributes\", \"isAuthenticatedBy\"], undefined).isObject()) {\n                const administratorName = privateParameters.administrator_name;\n                const administratorEmail = privateParameters.administrator_email;\n                const administratorPassword = privateParameters.administrator_password;\n                if (!this.environment.utils.check.that(administratorName).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                    throw new Error(\"Parameter «administrator_name» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «create-project»\");\n                }\n                if (!this.environment.utils.check.that(administratorEmail).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_\\@]+$/g)) {\n                    throw new Error(\"Parameter «administrator_email» must be a non-empty string based only on letters, numbers, '@', '.', '-' and '_' in order to «create-project»\");\n                }\n                if (!this.environment.utils.check.that(administratorPassword).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                    throw new Error(\"Parameter «administrator_password» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «create-project»\");\n                }\n                const sessionsOriginFile = __dirname + \"/defaults/sessions.json\";\n                const usersOriginFile = __dirname + \"/defaults/users.json\";\n                const groupsOriginFile = __dirname + \"/defaults/groups.json\";\n                const privilegesOriginFile = __dirname + \"/defaults/privileges.json\";\n                const sessions = await this.environment.utils.hydrateJSON(sessionsOriginFile);\n                const users = await this.environment.utils.hydrateJSON(usersOriginFile);\n                const groups = await this.environment.utils.hydrateJSON(groupsOriginFile);\n                const privileges = await this.environment.utils.hydrateJSON(privilegesOriginFile);\n                users.data[1].name = administratorName;\n                users.data[1].email = administratorEmail;\n                users.data[1].password = administratorPassword;\n                users.data[1].groups = [1];\n                users.data[1].privileges = [];\n                await this.environment.utils.dehydrateJSON(sessionsDestinationFile, sessions);\n                await this.environment.utils.dehydrateJSON(usersDestinationFile, users);\n                await this.environment.utils.dehydrateJSON(groupsDestinationFile, groups);\n                await this.environment.utils.dehydrateJSON(privilegesDestinationFile, privileges);\n            } else {\n                delete projectData.schema.tables.users;\n                delete projectData.schema.tables.groups;\n                delete projectData.schema.tables.privileges;\n                delete projectData.schema.tables.sessions;\n            }\n            const projectDestinationFile = projectDirectory + \"/project.json\";\n            await this.environment.utils.dehydrateJSON(projectDestinationFile, projectData);\n            ////////////////////////////////\n            // 3. Respond:\n            return { message: \"Operation «create-project» successfully achieved\", project };\n        } catch (error) {\n            this.environment.utils.debugError(\"CreateProject.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = CreateProject;";
fs.writeFileSync(node_52, node_contents_52, "utf8");

const node_53 = path.resolve(baseDirectory, ".", "src", "classes", "database", "Database.js");
const node_contents_53 = "class Database {\n\n    constructor(environment) {\n        this.environment = environment;\n        this.environment.utils.trace(\"Database.constructor\");\n    }\n\n    static get DEFAULT_COLUMN_ATTRIBUTES() {\n        return {\n            isUnique: false,\n            isType: \"string\",\n            isSubtype: null,\n            isEncrypted: false,\n            isReferenceOf: null,\n            isNullable: true,\n            hasDefault: null,\n            hasMinimum: null,\n            hasMaximum: null,\n            hasPattern: null,\n            hasPatternErrorMessage: null,\n            hasDescription: null,\n        };\n    };\n\n    static get DEFAULT_COLUMN_PROPERTIES() {\n        return {};\n    };\n\n    static get DEFAULT_TABLE_ATTRIBUTES() {\n        return {\n            hasDescription: null,\n            hasMulitpleUniqueKeys: [],\n            hasProtectors: [],\n        };\n    };\n\n    static get DEFAULT_TABLE_PROPERTIES() {\n        return {};\n    };\n\n    async start() {\n        try {\n            this.environment.utils.trace(\"Database.start\");\n            ////////////////////////////////////////////////////////////////////////\n            // Projects:\n            this.Project = require(__dirname + \"/Project.js\");\n            this.CreateProject = require(__dirname + \"/CreateProject.js\");\n            this.DeleteProject = require(__dirname + \"/DeleteProject.js\");\n            // Sessions:\n            this.Login = require(__dirname + \"/Login.js\");\n            this.Logout = require(__dirname + \"/Logout.js\");\n            this.Authenticate = require(__dirname + \"/Authenticate.js\");\n            // Data:\n            this.SelectRows = require(__dirname + \"/SelectRows.js\");\n            this.InsertRow = require(__dirname + \"/InsertRow.js\");\n            this.UpdateRow = require(__dirname + \"/UpdateRow.js\");\n            this.DeleteRow = require(__dirname + \"/DeleteRow.js\");\n            // Files:\n            this.GetFile = require(__dirname + \"/GetFile.js\");\n            this.SetFile = require(__dirname + \"/SetFile.js\");\n            // Schema:\n            this.ViewSchema = require(__dirname + \"/ViewSchema.js\");\n            this.AddTable = require(__dirname + \"/AddTable.js\");\n            this.AddColumn = require(__dirname + \"/AddColumn.js\");\n            this.UpdateTable = require(__dirname + \"/UpdateTable.js\");\n            this.UpdateColumn = require(__dirname + \"/UpdateColumn.js\");\n            this.DeleteTable = require(__dirname + \"/DeleteTable.js\");\n            this.DeleteColumn = require(__dirname + \"/DeleteColumn.js\");\n            // Protectors:\n            this.AddProtector = require(__dirname + \"/AddProtector.js\");\n            this.UpdateProtector = require(__dirname + \"/UpdateProtector.js\");\n            this.DeleteProtector = require(__dirname + \"/DeleteProtector.js\");\n            // Managers & Handlers:\n            this.TransactionManager = require(__dirname + \"/TransactionManager.js\");\n            this.ProtectorHandler = require(__dirname + \"/ProtectorHandler.js\");\n            // Process:\n            this.Process = require(__dirname + \"/Process.js\");\n            ////////////////////////////////////////////////////////////////////////\n        } catch(error) {\n            this.environment.utils.debugError(\"Database.create\", error);\n        }\n    }\n\n}\n\nmodule.exports = Database;";
fs.writeFileSync(node_53, node_contents_53, "utf8");

const node_54 = path.resolve(baseDirectory, ".", "src", "classes", "database", "DeleteColumn.js");
const node_contents_54 = "class DeleteColumn {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"DeleteColumn.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «delete-column»\");\n            }\n            // @TODO: apply protectors\n            const { table, column } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-row»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-column»\");\n            }\n            if (!this.environment.utils.check.that(column).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «column» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-column»\");\n            }\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"delete-column\");\n                    if (!(table in projectData.schema.tables)) {\n                        throw new Error(\"Parameter «table» must exist as table in schema in order to «delete-column»\");\n                    }\n                    if (!(column in projectData.schema.tables[table].columns)) {\n                        throw new Error(\"Parameter «column» must exist as column in schema in order to «delete-column»\");\n                    }\n                    delete projectData.schema.tables[table].columns[column];\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «delete-column» successfully achieved\", table, column };\n        } catch (error) {\n            this.environment.utils.debugError(\"DeleteColumn.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = DeleteColumn;";
fs.writeFileSync(node_54, node_contents_54, "utf8");

const node_55 = path.resolve(baseDirectory, ".", "src", "classes", "database", "DeleteProject.js");
const node_contents_55 = "class DeleteProject {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"DeleteProject.execute\");\n            ////////////////////////////////\n            // 1. Authorize operation:\n            const user = this.environment.settings.ADMINISTRATOR_USER;\n            const password = this.environment.settings.ADMINISTRATOR_PASSWORD;\n            if (privateParameters.user !== user) {\n                throw new Error(\"Specified user does not correspond to administrator in order to «delete-project»\");\n            }\n            if (privateParameters.password !== password) {\n                throw new Error(\"Specified password does not correspond to administrator in order to «delete-project»\");\n            }\n            ////////////////////////////////\n            // 2. Execute operation:\n            ////////////////////////////////\n            // 2.1. Validate parameters\n            const project = privateParameters.project;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.' and '-' in order to «create-project»\");\n            }\n            const { projectPath } = new this.environment.database.Project(project, \"delete-project\");\n            const projectDirectory = require(\"path\").dirname(projectPath);\n            const projectExists = await this.environment.utils.fileExists(projectDirectory);\n            if (!projectExists) {\n                throw new Error(\"Project «\" + project + \"» cannot be deleted because it does not exist\");\n            }\n            ////////////////////////////////\n            // 2.2. Delete recursively files & folders\n            await this.environment.utils.deleteDirectory(projectDirectory, true);\n            ////////////////////////////////\n            // 3. Respond:\n            return { message: \"Operation «delete-project» successfully achieved\", project };\n        } catch (error) {\n            this.environment.utils.debugError(\"DeleteProject.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = DeleteProject;";
