const node_56 = path.resolve(baseDirectory, ".", "src", "classes", "database", "DeleteProtector.js");
const node_contents_56 = "class DeleteProtector {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"DeleteProtector.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «delete-protector»\");\n            }\n            // @TODO: apply protectors\n            const { table } = privateParameters;\n            const { protector_new_name = undefined, protector_name, protector_type, parameters: parametersOriginal } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-protector»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-protector»\");\n            }\n            if (!this.environment.utils.check.that(protector_name).isString()) {\n                throw new Error(\"Parameter «protector_name» must be a string in order to «delete-protector»\");\n            }\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"delete-table\");\n                    if (!(table in projectData.schema.tables)) {\n                        throw new Error(\"Parameter «table» must exist as table in schema in order to «delete-protector»\");\n                    }\n                    const tableProtectors = projectData.schema.tables[table].attributes.hasProtectors || [];\n                    const coincidingProtectors = tableProtectors.filter(protector => protector.name === protector_name);\n                    if (this.environment.utils.check.that(coincidingProtectors.length).equals(0)) {\n                        throw new Error(\"Parameter «protector_name» must exist as table protector name in order to «delete-protector»\");\n                    }\n                    if (!this.environment.utils.check.that(coincidingProtectors.length).equals(1)) {\n                        throw new Error(\"Parameter «protector_name» must be unique as table protector name in order to «delete-protector»\");\n                    }\n                    if (!(\"hasProtectors\" in projectData.schema.tables[table].attributes)) {\n                        projectData.schema.tables[table].attributes.hasProtectors = [];\n                    }\n                    projectData.schema.tables[table].attributes.hasProtectors = projectData.schema.tables[table].attributes.hasProtectors.filter(protector => protector.name !== protector_name);\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «delete-protector» successfully achieved\", project };\n        } catch (error) {\n            this.environment.utils.debugError(\"DeleteProtector.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = DeleteProtector;";
fs.writeFileSync(node_56, node_contents_56, "utf8");

const node_57 = path.resolve(baseDirectory, ".", "src", "classes", "database", "DeleteRow.js");
const node_contents_57 = "class DeleteRow {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"DeleteRow.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation,\n                privateParameters.table,\n                privateParameters.id\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «delete-row»\");\n            }\n            // @TODO: apply protectors\n            const { table, id } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-row»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-row»\");\n            }\n            if (typeof id === \"number\") {\n                // @OK\n            } else if (!this.environment.utils.check.that(id).isStringMatchingRegex(/^[0-9]+$/g)) {\n                throw new Error(\"Parameter «id» must be a number in order to «delete-row»\");\n            }\n            const { projectData } = await this.environment.database.Project.initialize(project, \"delete-row\");\n            // @STEP: A) if main table is an externalized table:\n            if (this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"tables\", table, \"attributes\", \"isExternalizedBy\"], undefined).isObject()) {\n                const { host: externalHost, project: externalProject, table: externalTable } = projectData.schema.tables[table].attributes.isExternalizedBy;\n                const response = await this.environment.server.Requester.request(\"POST\", externalHost, {\n                    ...publicParameters,\n                    project: externalProject,\n                    operation: \"delete\",\n                }, {\n                    ...privateParameters,\n                    table: externalTable,\n                }, {\n                    authorization: configurations.authorization\n                }, false, false);\n                if (response.response.status === \"error\") {\n                    throw new Error(response.response.error.message);\n                }\n                return response.response.data;\n            }\n            // @STEP: B) if main table is a local table:\n            let deletedItem = undefined;\n            await this.environment.database.TransactionManager.block(project + \"/\" + table + \".json\", async (unblock, unblockFailing) => {\n                try {\n                    this.environment.utils.trace(\"DeleteRow.execute:transaction#1\");\n                    const tablePath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/\" + table + \".json\");\n                    const tableDB = await this.environment.utils.hydrateJSON(tablePath);\n                    if (!(id in tableDB.data)) {\n                        throw new Error(\"Parameter «id» must refer to an existing «\" + table + \"» identifier in order to «delete-row»\");\n                    }\n                    // @TOTEST: check secondary table reference integrity\n                    const allTables = projectData.schema.tables;\n                    const allTablesIds = Object.keys(allTables);\n                    for(let indexTables = 0; indexTables < allTablesIds.length; indexTables++) {\n                        const secondaryTableId = allTablesIds[indexTables];\n                        const secondaryTableColumn = allTables[secondaryTableId].columns;\n                        const secondaryTableColumnIds = Object.keys(secondaryTableColumn);\n                        CheckingColumns:\n                        for(let indexColumns = 0; indexColumns < secondaryTableColumnIds.length; indexColumns++) {\n                            const secondaryColumnId = secondaryTableColumnIds[indexColumns];\n                            const secondaryColumn = secondaryTableColumn[secondaryColumnId];\n                            const isReferenceOf = secondaryColumn.attributes.isReferenceOf;\n                            if(isReferenceOf === table) {\n                                // @STEP: B.A) if secondary table is an externalized table:\n                                if (this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"tables\", secondaryTableId, \"attributes\", \"isExternalizedBy\"], undefined).isObject()) {\n                                    const { host: externalHost, project: externalProject, table: externalTable } = projectData.schema.tables[secondaryTableId].attributes.isExternalizedBy;\n                                    if (secondaryColumn.attributes.isType === \"list\") {\n                                        const responseList = await this.environment.server.Requester.request(\"GET\", externalHost, {\n                                            ...publicParameters,\n                                            project: externalProject,\n                                            table: externalTable,\n                                            operation: \"select\",\n                                            where: JSON.stringify([[secondaryColumnId, \"has\", id]]),\n                                        }, {}, {\n                                            authorization: configurations.authorization\n                                        }, false, false);\n                                        if (responseList.response.status === \"error\") {\n                                            throw new Error(responseList.response.error.message);\n                                        }\n                                        if (responseList.response.data.items.length !== 0) {\n                                            throw new Error(\"Row cannot be deleted because «\" + secondaryTableId + \".\" + secondaryColumnId + \"» as list on id «\" + responseList.response.data.items[0].id + \"» contains an externalized reference to it and at least \" + responseList.response.data.items.length + \" items more also contain externalized references to this item\");\n                                        }\n                                    } else if (secondaryColumn.attributes.isType === \"object\") {\n                                        const responseObject = await this.environment.server.Requester.request(\"GET\", externalHost, {\n                                            ...publicParameters,\n                                            project: externalProject,\n                                            table: externalTable,\n                                            operation: \"select\",\n                                            where: JSON.stringify([[secondaryColumnId, \"=\", id]]),\n                                        }, {}, {\n                                            authorization: configurations.authorization\n                                        }, false, false);\n                                        if (responseObject.response.status === \"error\") {\n                                            throw new Error(responseObject.response.error.message);\n                                        }\n                                        if (responseObject.response.data.items.length !== 0) {\n                                            throw new Error(\"Row cannot be deleted because «\" + secondaryTableId + \".\" + secondaryColumnId + \"» as object on id «\" + responseObject.response.data.items[0].id + \"» contains an externalized reference to it and at least \" + responseObject.response.data.items.length + \" items more also contain externalized references to this item.\");\n                                        }\n                                    }\n                                    continue CheckingColumns;\n                                }\n                                // @STEP: B.B) if secondary table is a local table:\n                                const secondaryTablePath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/\" + isReferenceOf + \".json\");\n                                const secondaryTableDB = await this.environment.utils.hydrateJSON(secondaryTablePath);\n                                const secondaryTableData = secondaryTableDB.data;\n                                const secondaryTableIds = Object.keys(secondaryTableData);\n                                CheckingItems:\n                                for(let indexItems = 0; indexItems < secondaryTableIds.length; indexItems++) {\n                                    const secondaryTableId = secondaryTableIds[indexItems];\n                                    const secondaryItem = secondaryTableData[secondaryTableId];\n                                    if (secondaryColumn.attributes.isType === \"list\") {\n                                        if (!Array.isArray(secondaryItem[secondaryColumnId])) {\n                                            continue CheckingItems;\n                                        }\n                                        const containsItem = secondaryItem[secondaryColumnId].indexOf(id) !== -1;\n                                        if(containsItem) {\n                                            throw new Error(\"Row cannot be deleted because «\" + secondaryTableId + \".\" + secondaryColumnId + \"» on id «\" + secondaryTableId + \"» contains a reference to it\");\n                                        }\n                                    } else if (secondaryColumn.attributes.isType === \"object\") {\n                                        const isItem = secondaryItem[secondaryColumnId] === id;\n                                        if(isItem) {\n                                            throw new Error(\"Row cannot be deleted because «\" + secondaryTableId + \".\" + secondaryColumnId + \"» on id «\" + secondaryTableId + \"» refers to it\");\n                                        }\n                                    }\n                                }\n                            }\n                        }\n                    }\n                    deletedItem = tableDB.data[id];\n                    delete tableDB.data[id];\n                    await this.environment.utils.dehydrateJSON(tablePath, tableDB);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «delete-row» successfully achieved\", table, id: deletedItem.id, item: deletedItem };\n        } catch (error) {\n            this.environment.utils.debugError(\"DeleteRow.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = DeleteRow;";
fs.writeFileSync(node_57, node_contents_57, "utf8");

const node_58 = path.resolve(baseDirectory, ".", "src", "classes", "database", "DeleteTable.js");
const node_contents_58 = "class DeleteTable {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"DeleteTable.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «delete-table»\");\n            }\n            // @TODO: apply protectors\n            const { table } = privateParameters;\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-table»\");\n            }\n            const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"delete-table\");\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    if (!(table in projectData.schema.tables)) {\n                        throw new Error(\"Parameter «table» must exist as table in schema in order to «delete-table»\");\n                    }\n                    delete projectData.schema.tables[table];\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    const tablePath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/\" + table + \".json\");\n                    await this.environment.utils.deleteFile(tablePath);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «delete-table» successfully achieved\" };\n        } catch (error) {\n            this.environment.utils.debugError(\"DeleteTable.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = DeleteTable;";
fs.writeFileSync(node_58, node_contents_58, "utf8");

const node_59 = path.resolve(baseDirectory, ".", "src", "classes", "database", "GetFile.js");
const node_contents_59 = "const fs = require(\"fs\");\n\nclass GetFile {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations, originalResponse) {\n        try {\n            this.environment.utils.trace(\"GetFile.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation,\n                privateParameters.table,\n                privateParameters.id\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «get-file»\");\n            }\n            // @TODO: apply protectors\n            const { table, column, columnIndex = undefined } = publicParameters;\n            let { id = \"0\" } = publicParameters;\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Required parameter «table» to be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «get-file»\");\n            }\n            if (typeof id === \"number\") {\n                // @OK\n            } else if (!this.environment.utils.check.that(id).isStringMatchingRegex(/^[0-9]+$/g)) {\n                throw new Error(\"Required parameter «id» to be a number in order to «get-file»\");\n            }\n            if (!this.environment.utils.check.that(column).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Required parameter «column» to be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «get-file»\");\n            }\n            if(typeof columnIndex === \"undefined\") {\n                // @OK\n            } else if (typeof columnIndex === \"number\") {\n                // @OK\n            } else if (!this.environment.utils.check.that(id).isStringMatchingRegex(/^[0-9]+$/g)) {\n                throw new Error(\"Required parameter «id» to be a number in order to «get-file»\");\n            }\n            if(typeof id === \"string\") {\n                id = parseInt(id);\n            }\n            const { projectData } = await this.environment.database.Project.initialize(project, \"get-file\");\n            const tableSchema = projectData.schema.tables[table];\n            if (!this.environment.utils.check.that(tableSchema).itsProperty([ \"columns\", column, \"attributes\", \"isType\"], undefined).isOneOf([\"file\", \"image\"])) {\n                this.environment.utils.debug(tableSchema.columns[column].attributes.isType);\n                throw new Error(\"Required parameter «table» and «column» to refer to a schema column that is type «file» or «image» in order to «get-file»\");\n            }\n            const protectorHandler = await this.environment.database.ProtectorHandler.initialize(this.environment, publicParameters, privateParameters, configurations, authentication, projectData);\n            await protectorHandler.applyOnBeforeViewProtectors({ projectData });\n            const selectOperation = new this.environment.database.SelectRows(this.environment);\n            const selectResponse = await selectOperation.execute({\n                project,\n                table,\n                where: JSON.stringify([[ \"id\", \"=\", id ]])\n            }, {}, configurations);\n            if(selectResponse.items.length === 0) {\n                throw new Error(\"Required parameter «id» to refer to a «table» (\" + table + \") identifier in order to «get-file»\");\n            } else if(selectResponse.items.length !== 1) {\n                throw new Error(\"Parameter parameter «id» to not belong to a corrupted data item. Please, contact the administrator of the server.\");\n            }\n            const selectedProperty = selectResponse.items[0][column];\n            if (!this.environment.utils.check.that(selectedProperty).isStringMatchingRegex(/^[A-Za-z0-9\\-\\.\\_]+/g)) {\n                throw new Error(\"Required property «\" + column + \"» (\" + selectedProperty + \") from item «\" + table + \"» on identifier «\" + id + \"» to only be composed by letters, numbers and «-», «.» and «_» in order to «get-file»\")\n            }\n            // @TODO: apply triggers\n            const targetItem = selectResponse.items[0];\n            const targetPath = this.environment.utils.resolveFromSrc(targetItem[column]);\n            const targetReader = fs.createReadStream(targetPath);\n            originalResponse.setHeader(\"Access-Control-Allow-Origin\", \"*\");\n            originalResponse.setHeader(\"Access-Control-Allow-Headers\", \"*\");\n            originalResponse.setHeader(\"Access-Control-Allow-Methods\", \"GET, POST, PUT, PATCH, DELETE, OPTIONS\");\n            targetReader.on(\"error\", error => {\n                originalResponse.write(\"There were errors on the process of «get-file»: \");\n                originalResponse.write(\"[Error:] \" + error.name + \" [Message:] \" + error.message + \" [Stack:] \" + error.stack);\n                originalResponse.end();\n                return;\n            });\n            return targetReader.pipe(originalResponse);\n        } catch (error) {\n            this.environment.utils.debugError(\"GetFile.execute\", error, true);\n        }\n    }\n\n    dispatchResult(project, table, column, id, item) {\n        try {\n        } catch(error) {\n            \n        }\n    }\n\n}\n\nmodule.exports = GetFile;";
fs.writeFileSync(node_59, node_contents_59, "utf8");

const node_60 = path.resolve(baseDirectory, ".", "src", "classes", "database", "InsertRow.js");
const node_contents_60 = "class InsertRow {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"InsertRow.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation,\n                privateParameters.table,\n                privateParameters.value\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «insert-row»\");\n            }\n            const { projectData } = await this.environment.database.Project.initialize(project, \"insert-row\");\n            const protectorHandler = await this.environment.database.ProtectorHandler.initialize(this.environment, publicParameters, privateParameters, configurations, authentication, projectData);\n            const { table, value } = privateParameters;\n            const valueParsed = JSON.parse(value);\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «insert-row»\");\n            }\n            // @STEP: A) if it is an externalized table:\n            if (this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"tables\", table, \"attributes\", \"isExternalizedBy\"], undefined).isObject()) {\n                const { host: externalHost, project: externalProject, table: externalTable } = projectData.schema.tables[table].attributes.isExternalizedBy;\n                const response = await this.environment.server.Requester.request(\"POST\", externalHost, {\n                    ...publicParameters,\n                    project: externalProject,\n                    operation: \"insert\",\n                }, {\n                    ...privateParameters,\n                    table: externalTable\n                }, {\n                    authorization: configurations.authorization\n                }, false, false);\n                if (response.response.status === \"error\") {\n                    throw new Error(response.response.error.message);\n                }\n                return response.response.data;\n            }\n            // @STEP: B) if it is a local table:\n            delete valueParsed.id;\n            let valueFixed = undefined;\n            await this.environment.database.TransactionManager.block(project + \"/\" + table + \".json\", async (unblock, unblockFailing) => {\n                try {\n                    this.environment.utils.trace(\"InsertRow.execute:transaction#1\");\n                    const tablePath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/\" + table + \".json\");\n                    const tableDB = await this.environment.utils.hydrateJSON(tablePath);\n                    await protectorHandler.applyOnBeforePersistProtectors({ value: valueParsed, projectData });\n                    valueFixed = await this.environment.utils.check.that(valueParsed).followsSchemaOf(projectData, table, tableDB.data, \"insert\", project, configurations.authorization, authentication, this.environment);\n                    const nextId = tableDB.id++;\n                    valueFixed.id = nextId;\n                    tableDB.data[nextId] = valueFixed;\n                    await this.environment.utils.dehydrateJSON(tablePath, tableDB);\n                    unblock();\n                } catch(error) {\n                    unblockFailing(error);\n                }\n            });\n            const response = {\n                message: \"Operation «insert-row» successfully achieved\",\n                table,\n                id: valueFixed.id,\n                item: valueFixed\n            };\n            await protectorHandler.applyOnAfterPersistProtectors(response, { value: valueFixed });\n            // @TODO: apply triggers\n            return response;\n        } catch (error) {\n            this.environment.utils.debugError(\"InsertRow.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = InsertRow;";
fs.writeFileSync(node_60, node_contents_60, "utf8");

const node_61 = path.resolve(baseDirectory, ".", "src", "classes", "database", "Login.js");
const node_contents_61 = "class Login {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"Login.execute\");\n            ////////////////////////////////\n            // 1. Execute operation:\n            ////////////////////////////////\n            // 1.1. Validate parameters\n            const { project } = publicParameters;\n            const { user: userOrEmail, password } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must follow the proper format in order to «login»\");\n            }\n            ////////////////////////////////\n            // 1.2. Create session (or return current)\n            ////////////////////////////////\n            // 1.2.A. Respond by externalized auth system:\n            const { projectData } = await this.environment.database.Project.initialize(project, \"login\");\n            if (this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"attributes\", \"isAuthenticatedBy\"], undefined).isObject()) {\n                const { url: authURL, project: authProjectId } = projectData.schema.attributes.isAuthenticatedBy;\n                const response = await this.environment.server.Requester.request(\"POST\", authURL, {\n                    project: authProjectId,\n                    operation: \"login\"\n                }, {\n                    user: userOrEmail,\n                    password\n                }, {}, false, false);\n                if(response.response.status === \"error\") {\n                    throw new Error(response.response.error.message);\n                }\n                return response.response.data;\n            }\n            ////////////////////////////////\n            // 1.2.B. Respond by self auth system:\n            const usersPath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/users.json\");\n            const sessionsPath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/sessions.json\");\n            const users = await this.environment.utils.hydrateJSON(usersPath);\n            const matchedUsers = Object.values(users.data).filter(user => ((user.name === userOrEmail) || (user.email === userOrEmail)));\n            if(matchedUsers.length === 0) {\n                throw new Error(\"User was not found in order to «login»\");\n            }\n            const bypasswordedUsers = matchedUsers.filter(user => user.password === password);\n            if(bypasswordedUsers.length === 0) {\n                throw new Error(\"Password is not correct in order to «login»\");\n            }\n            const matchedUser = bypasswordedUsers[0];\n            let session = undefined;\n            let isRetaken = false;\n            await this.environment.database.TransactionManager.block(project + \"/sessions.json\", async (unblock, unblockFailing) => {\n                try {\n                    const sessions = await this.environment.utils.hydrateJSON(sessionsPath);\n                    const matchedSessions = Object.values(sessions.data).filter(session => session.user === matchedUser.id);\n                    const isRetaken = matchedSessions.length !== 0;\n                    const sessionToken = isRetaken ? matchedSessions[0].token : this.environment.utils.generateRandomString(100);\n                    const id = isRetaken ? matchedSessions[0].id : sessions.id++;\n                    session = { id, user: matchedUser.id, token: sessionToken };\n                    sessions.data[id] = session;\n                    await this.environment.utils.dehydrateJSON(sessionsPath, sessions);\n                    const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n                    const authentication = await authenticator.authenticate(sessionToken);\n                    delete authentication.user.password;\n                    delete authentication.user.created_at;\n                    delete authentication.user.updated_at;\n                    session.authentication = {\n                        user: authentication.user,\n                        groups: authentication.groups,\n                        privileges: authentication.privileges\n                    };\n                    unblock();\n                } catch(error) {\n                    unblockFailing(error);\n                }\n            });\n            ////////////////////////////////\n            // 2. Respond:\n            return { message: \"Operation «login» successfully achieved\", session, taken: isRetaken };\n        } catch (error) {\n            this.environment.utils.debugError(\"Login.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = Login;";
fs.writeFileSync(node_61, node_contents_61, "utf8");

const node_62 = path.resolve(baseDirectory, ".", "src", "classes", "database", "Logout.js");
const node_contents_62 = "class Logout {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"Logout.execute\");\n            ////////////////////////////////\n            // 1. Execute operation:\n            ////////////////////////////////\n            // 1.1. Validate parameters\n            const { project } = publicParameters;\n            const { authorization: token } = configurations;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must follow the proper format in order to «logout»\");\n            }\n            if (!this.environment.utils.check.that(token).hasLengthOf(100)) {\n                throw new Error(\"Parameter «token» is not correct in order to «logout»\");\n            }\n            ////////////////////////////////\n            // 1.2. Destroy session\n            ////////////////////////////////\n            // 1.2.A. Respond by externalized auth system:\n            const { projectData } = await this.environment.database.Project.initialize(project, \"login\");\n            if (this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"attributes\", \"isAuthenticatedBy\"], undefined).isObject()) {\n                const { url: authURL, project: authProjectId } = projectData.schema.attributes.isAuthenticatedBy;\n                const response = await this.environment.server.Requester.request(\"POST\", authURL, {\n                    project: authProjectId,\n                    operation: \"logout\"\n                }, {}, {\n                    authorization: token\n                }, false, false);\n                if (response.response.status === \"error\") {\n                    throw new Error(response.response.error.message);\n                }\n                return response.response.data;\n            }\n            ////////////////////////////////\n            // 1.2.B. Respond by self auth system:\n            await this.environment.database.TransactionManager.block(project + \"/sessions.json\", async (unblock, unblockFailing) => {\n                try {\n                    const sessionsPath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/sessions.json\");\n                    const sessions = await this.environment.utils.hydrateJSON(sessionsPath);\n                    const matchedSessions = Object.values(sessions.data).filter(session => session.token === token);\n                    if (matchedSessions.length === 0) {\n                        throw new Error(\"Session was not found in order to «logout»\");\n                    }\n                    delete sessions.data[matchedSessions[0].id];\n                    await this.environment.utils.dehydrateJSON(sessionsPath, sessions);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            ////////////////////////////////\n            // 2. Respond:\n            return { message: \"Operation «logout» successfully achieved\" };\n        } catch (error) {\n            this.environment.utils.debugError(\"Logout.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = Logout;";
fs.writeFileSync(node_62, node_contents_62, "utf8");

const node_63 = path.resolve(baseDirectory, ".", "src", "classes", "database", "Process.js");
const node_contents_63 = "class Process {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"Process.execute\");\n            const { project, process: processParameter = \"\" } = publicParameters;\n            const { authorization: token } = configurations;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must follow the proper format in order to «process»\");\n            }\n            if (!this.environment.utils.check.that(token).hasLengthOf(100)) {\n                throw new Error(\"Parameter «token» is not correct in order to «process»\");\n            }\n            const { projectData } = await this.environment.database.Project.initialize(project, \"process\");\n            if(Object.keys(projectData.schema.attributes.hasEnabledProcesses).indexOf(processParameter) === -1) {\n                throw new Error(\"Required parameter «process» to be an identifiable process\");\n            }\n            if(projectData.schema.attributes.hasEnabledProcesses[processParameter] !== true) {\n                throw new Error(\"Required parameter «process» to refer to an enabled process\");\n            }\n            let response = undefined;\n            switch (processParameter) {\n                case \"\": {\n                    throw new Error(\"Required parameter «process» to be specified\");\n                }\n                case \"restologia.official.org/common/ping\": {\n                    response = await require(__dirname + \"/process/\" + \"restologia.official.org/common/ping/index.js\").call(this.environment, publicParameters, privateParameters, configurations);\n                    break;\n                }\n                case \"restologia.official.org/common/os\": {\n                    response = await require(__dirname + \"/process/\" + \"restologia.official.org/common/os/index.js\").call(this.environment, publicParameters, privateParameters, configurations);\n                    break;\n                }\n                ////>>>> INSERT_PROCESSES_LAST_CASE_CLAUSE_HERE <<<<////\n                default: {\n                    throw new Error(\"Required parameter «process» to be an identifiable process\");\n                }\n            }\n            return { message: \"Operation «process» successfully achieved\", ...response };\n        } catch (error) {\n            this.environment.utils.debugError(\"Process.execute\", error, true);\n        }\n    }\n\n    static selfUpdate(environment) {\n        delete require.cache[__dirname + \"/Process.js\"];\n        environment.database.Process = require(__dirname + \"/Process.js\");\n    }\n\n}\n\nmodule.exports = Process;";
fs.writeFileSync(node_63, node_contents_63, "utf8");

const node_64 = path.resolve(baseDirectory, ".", "src", "classes", "database", "Project.js");
const node_contents_64 = "const utils = require(__dirname + \"/../Utils.js\");\n\nclass Project {\n\n    static initialize(...args) {\n        return (new this(...args)).initialize();\n    }\n\n    constructor(projectId, operation = \"initialize-project\") {\n        this.projectId = projectId;\n        this.operation = operation;\n        this.projectPath = utils.resolveFromSrc(\"data/projects/\" + this.projectId + \"/project.json\");\n        this.projectData = undefined;\n    }\n\n    initialize() {\n        if(this.projectData) {\n            return this;\n        }\n        if(!utils.check.that(this.projectId).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n            throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «\" + this.operation + \"»\");\n        }\n        return utils.hydrateJSON(this.projectPath).then(projectData => {\n            this.projectData = projectData;\n            return this;\n        });\n    }\n\n}\n\nmodule.exports = Project;";
fs.writeFileSync(node_64, node_contents_64, "utf8");

const node_65 = path.resolve(baseDirectory, ".", "src", "classes", "database", "ProtectorHandler.js");
const node_contents_65 = "class ProtectorHandler {\n\n    static initialize(environment, ...args) {\n        const protectorHandler = new this(environment);\n        return protectorHandler.initializeProtectors(...args);\n    }\n\n    constructor(environment) {\n        this.environment = environment;\n        this.protectors = undefined;\n        this.projectId = undefined;\n        this.projectData = undefined;\n        this.publicParameters = undefined;\n        this.privateParameters = undefined;\n        this.configurations = undefined;\n    }\n    \n    async initializeProtectors(publicParameters, privateParameters, configurations, authentication, projectData) {\n        try {\n            /////////////////////////////////////////////////////\n            this.authentication = authentication;\n            this.publicParameters = publicParameters;\n            this.privateParameters = privateParameters;\n            this.configurations = configurations;\n            this.authentication = authentication;\n            this.projectData = projectData;\n            const project = publicParameters.project;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «getProtectors»\");\n            }\n            const operation = publicParameters.operation;\n            this.projectId = project;\n            this.projectData = projectData;\n            let protectorsDefinitions = [];\n            switch (operation) {\n                case \"select\": {\n                    const table = publicParameters.table;\n                    const tableAttributes = projectData.schema.tables[table].attributes;\n                    if (\"hasProtectors\" in tableAttributes) {\n                        protectorsDefinitions = tableAttributes.hasProtectors;\n                    }\n                    break;\n                }\n                case \"insert\":\n                case \"update\":\n                case \"delete\": {\n                    const table = privateParameters.table;\n                    const tableAttributes = projectData.schema.tables[table].attributes;\n                    if (\"hasProtectors\" in tableAttributes) {\n                        protectorsDefinitions = tableAttributes.hasProtectors;\n                    }\n                    break;\n                }\n                case \"add-table\":\n                case \"add-column\":\n                case \"add-protector\":\n                case \"update-table\":\n                case \"update-column\":\n                case \"update-protector\":\n                case \"delete-table\":\n                case \"delete-column\":\n                case \"delete-protector\": {\n                    protectorsDefinitions = projectData.schema.operations.alterSchema.hasProtectors;\n                    break;\n                }\n            }\n            /////////////////////////////////////////////////////\n            const protectors = [];\n            for (let indexProtectors = 0; indexProtectors < protectorsDefinitions.length; indexProtectors++) {\n                const protectorDefinition = protectorsDefinitions[indexProtectors];\n                if (!this.environment.utils.check.that(protectorDefinition.id).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                    throw new Error(\"Setting «protector.id» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «getProtectors»\");\n                }\n                const ProtectorClass = require(__dirname + \"/protectors/\" + protectorDefinition.id);\n                const protector = new ProtectorClass(this.environment, protectorDefinition);\n                protectors.push(protector);\n            }\n            this.protectors = protectors;\n            return this;\n        } catch(error) {\n            this.environment.utils.debugError(\"ProtectorHandler.applyProtectors\", error, true);\n        }\n    }\n    \n    async applyOnBeforeViewProtectors(extra = {}, ...others) {\n        try {\n            for(let indexProtector = 0; indexProtector < this.protectors.length; indexProtector++) {\n                const protector = this.protectors[indexProtector];\n                await protector.onBeforeView(this.publicParameters, this.privateParameters, this.configurations, this.authentication, extra, ...others);\n            }\n        } catch(error) {\n            this.environment.utils.debugError(\"ProtectorHandler.applyOnBeforeViewProtectors\", error, true);\n        }    \n    }\n    \n    async applyOnBeforePersistProtectors(extra = {}, ...others) {\n        try {\n            for (let indexProtector = 0; indexProtector < this.protectors.length; indexProtector++) {\n                const protector = this.protectors[indexProtector];\n                await protector.onBeforePersist(this.publicParameters, this.privateParameters, this.configurations, this.authentication, extra, ...others);\n            }\n        } catch(error) {\n            this.environment.utils.debugError(\"ProtectorHandler.applyOnBeforePersistProtectors\", error, true);\n        }\n    }\n    \n    async applyOnAfterViewProtectors(extra = {}, ...others) {\n        try {\n            for (let indexProtector = 0; indexProtector < this.protectors.length; indexProtector++) {\n                const protector = this.protectors[indexProtector];\n                await protector.onAfterView(this.publicParameters, this.privateParameters, this.configurations, this.authentication, extra, ...others);\n            }\n        } catch(error) {\n            this.environment.utils.debugError(\"ProtectorHandler.applyOnAfterViewProtectors\", error, true);\n        }    \n    }\n    \n    async applyOnAfterPersistProtectors(extra = {}, ...others) {\n        try {\n            for (let indexProtector = 0; indexProtector < this.protectors.length; indexProtector++) {\n                const protector = this.protectors[indexProtector];\n                await protector.onAfterPersist(this.publicParameters, this.privateParameters, this.configurations, this.authentication, extra, ...others);\n            }\n        } catch(error) {\n            this.environment.utils.debugError(\"ProtectorHandler.applyOnAfterPersistProtectors\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = ProtectorHandler;";
