const node_70 = path.resolve(baseDirectory, ".", "src", "classes", "database", "UpdateProtector.js");
const node_contents_70 = "class UpdateProtector {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"UpdateProtector.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «update-protector»\");\n            }\n            // @TODO: apply protectors\n            const { table } = privateParameters;\n            const { protector_new_name = undefined, protector_name, protector_type, parameters: parametersOriginal } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «update-protector»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «update-protector»\");\n            }\n            if (!this.environment.utils.check.that(parametersOriginal).isString()) {\n                throw new Error(\"Parameter «parameters» must be a string in order to «update-protector»\");\n            }\n            if ((!this.environment.utils.check.that(protector_new_name)) && (!this.environment.utils.check.that(protector_new_name).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g))) {\n                throw new Error(\"Parameter «protector_new_name» must be ommited or a string based only on letters, numbers, '.', '-' and '_' in order to «update-protector»\");\n            }\n            if (!this.environment.utils.check.that(protector_type).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «protector_type» must be ommited or a string based only on letters, numbers, '.', '-' and '_' in order to «update-protector»\");\n            }\n            if (!this.environment.utils.check.that(protector_name).isString()) {\n                throw new Error(\"Parameter «protector_name» must be a string in order to «update-protector»\");\n            }\n            const parameters = JSON.parse(parametersOriginal);\n            if (!this.environment.utils.check.that(parameters).isObject()) {\n                throw new Error(\"Parameter «parameters» must be a JSON object in order to «update-protector»\");\n            }\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"update-table\");\n                    if (!(table in projectData.schema.tables)) {\n                        throw new Error(\"Parameter «table» must exist as table in schema in order to «update-protector»\");\n                    }\n                    const tableProtectors = projectData.schema.tables[table].attributes.hasProtectors || [];\n                    const coincidingProtectors = tableProtectors.filter(protector => protector.name === protector_name);\n                    if (this.environment.utils.check.that(coincidingProtectors.length).equals(0)) {\n                        throw new Error(\"Parameter «protector_name» must exist as table protector name in order to «update-protector»\");\n                    }\n                    if (!this.environment.utils.check.that(coincidingProtectors.length).equals(1)) {\n                        throw new Error(\"Parameter «protector_name» must be unique as table protector name in order to «update-protector»\");\n                    }\n                    const availableProtectorIdsBrute = await this.environment.utils.listDirectory(__dirname + \"/protectors\");\n                    const availableProtectorIds = availableProtectorIdsBrute.filter(protector => protector.endsWith(\".js\")).map(protector => protector.replace(/\\.js$/g, \"\"));\n                    if (availableProtectorIds.indexOf(protector_type) === -1) {\n                        throw new Error(\"Parameter «parameter_type» must match a valid protector type in order to «update-protector»\");\n                    }\n                    const protectorClass = require(__dirname + \"/protectors/\" + protector_type + \".js\");\n                    await protectorClass.checkSettings(parameters, projectData, table, \"update-protector\");\n                    if (!(\"hasProtectors\" in projectData.schema.tables[table].attributes)) {\n                        projectData.schema.tables[table].attributes.hasProtectors = [];\n                    }\n                    projectData.schema.tables[table].attributes.hasProtectors = projectData.schema.tables[table].attributes.hasProtectors.map(protector => {\n                        if(protector.name !== protector_name) {\n                            return protector;\n                        }\n                        return {\n                            id: protector_type,\n                            fixed: false,\n                            name: protector_new_name,\n                            parameters,\n                        };\n                    });\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «update-protector» successfully achieved\", project };\n        } catch (error) {\n            this.environment.utils.debugError(\"UpdateProtector.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = UpdateProtector;";
fs.writeFileSync(node_70, node_contents_70, "utf8");

const node_71 = path.resolve(baseDirectory, ".", "src", "classes", "database", "UpdateRow.js");
const node_contents_71 = "class UpdateRow {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"UpdateRow.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation,\n                privateParameters.table,\n                privateParameters.id,\n                privateParameters.value\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «update-row»\");\n            }\n            // @TODO: apply protectors\n            const { table, id, value } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «update-row»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «update-row»\");\n            }\n            if (!this.environment.utils.check.that(id).isInteger()) {\n                throw new Error(\"Parameter «id» must be an integer number in order to «update-row»\");\n            }\n            const originalValueParsed = JSON.parse(value);\n            const { projectData } = await this.environment.database.Project.initialize(project, \"update-row\");\n            // @STEP: A) if it is an externalized table:\n            if (this.environment.utils.check.that(projectData).itsProperty([\"schema\", \"tables\", table, \"attributes\", \"isExternalizedBy\"], undefined).isObject()) {\n                const { host: externalHost, project: externalProject, table: externalTable } = projectData.schema.tables[table].attributes.isExternalizedBy;\n                const response = await this.environment.server.Requester.request(\"POST\", externalHost, {\n                    ...publicParameters,\n                    project: externalProject,\n                    operation: \"update\",\n                }, {\n                    ...privateParameters,\n                    table: externalTable\n                }, {\n                    authorization: configurations.authorization\n                }, false, false);\n                if (response.response.status === \"error\") {\n                    throw new Error(response.response.error.message);\n                }\n                return response.response.data;\n            }\n            // @STEP: B) if it is a local table:\n            const protectorErrors = [];\n            let valueFixed = undefined;\n            const protectorHandler = await this.environment.database.ProtectorHandler.initialize(this.environment, publicParameters, privateParameters, configurations, authentication, projectData);\n            await this.environment.database.TransactionManager.block(project + \"/\" + table + \".json\", async (unblock, unblockFailing) => {\n                try {\n                    this.environment.utils.trace(\"UpdateRow.execute:transaction#1\");\n                    const tablePath = this.environment.utils.resolveFromSrc(\"data/projects/\" + project + \"/data/\" + table + \".json\");\n                    const tableDB = await this.environment.utils.hydrateJSON(tablePath);\n                    if(!(id in tableDB.data)) {\n                        throw new Error(\"Parameter «id» must refer to an existing «\" + table + \"» identifier in order to «update-row»\");\n                    }\n                    const valuePrevious = tableDB.data[id];\n                    let valueParsed = Object.assign({}, valuePrevious, originalValueParsed, { id });\n                    await protectorHandler.applyOnBeforePersistProtectors({ value: valueParsed, protectorErrors });\n                    valueParsed = Object.assign({}, valuePrevious, valueParsed, { id });\n                    valueFixed = await this.environment.utils.check.that(valueParsed).followsSchemaOf(projectData, table, tableDB.data, \"update\", project, configurations.authorization, authentication, this.environment);\n                    tableDB.data[id] = valueFixed;\n                    await this.environment.utils.dehydrateJSON(tablePath, tableDB);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            const response = {\n                message: \"Operation «update-row» successfully achieved\",\n                table,\n                // id: valueFixed.id,\n                item: valueFixed,\n                protectorErrors,\n            };\n            await protectorHandler.applyOnAfterPersistProtectors(response, { value: valueFixed });\n            return response;\n        } catch (error) {\n            this.environment.utils.debugError(\"UpdateRow.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = UpdateRow;";
fs.writeFileSync(node_71, node_contents_71, "utf8");

const node_72 = path.resolve(baseDirectory, ".", "src", "classes", "database", "UpdateTable.js");
const node_contents_72 = "class UpdateTable {\n\n    constructor(environment) {\n        this.environment = environment;\n    }\n\n    async execute(publicParameters, privateParameters, configurations) {\n        try {\n            this.environment.utils.trace(\"UpdateTable.execute\");\n            const project = publicParameters.project;\n            const authenticator = new this.environment.auth.Authenticator(this.environment, project);\n            const authentication = await authenticator.authenticate(configurations.authorization);\n            const authorizator = new this.environment.auth.Authorizator(this.environment, project);\n            const authorization = await authorizator.authorize(authentication);\n            const hasAuthorization = await authorization.forOperation(\n                publicParameters.operation\n            );\n            if (!hasAuthorization) {\n                throw new Error(\"User is not allowed to «update-table»\");\n            }\n            // @TODO: apply protectors\n            const { table, attributes: attributesOriginal = \"{}\", properties: propertiesOriginal = \"{}\" } = privateParameters;\n            if (!this.environment.utils.check.that(project).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «project» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «delete-row»\");\n            }\n            if (!this.environment.utils.check.that(table).isStringMatchingRegex(/^[A-Za-z0-9\\.\\-\\_]+$/g)) {\n                throw new Error(\"Parameter «table» must be a non-empty string based only on letters, numbers, '.', '-' and '_' in order to «update-table»\");\n            }\n            if (!this.environment.utils.check.that(attributesOriginal).isString()) {\n                throw new Error(\"Parameter «attributes» must be a string or omitted in order to «update-table»\");\n            }\n            if (!this.environment.utils.check.that(propertiesOriginal).isString()) {\n                throw new Error(\"Parameter «properties» must be a string or omitted in order to «update-table»\");\n            }\n            const attributes = JSON.parse(attributesOriginal);\n            const properties = JSON.parse(propertiesOriginal);\n            if (!this.environment.utils.check.that(attributes).isObject()) {\n                throw new Error(\"Parameter «attributes» must be a JSON object or omitted in order to «update-table»\");\n            }\n            if (!this.environment.utils.check.that(properties).isObject()) {\n                throw new Error(\"Parameter «properties» must be a JSON object or omitted in order to «update-table»\");\n            }\n            await this.environment.database.TransactionManager.block(project + \"/project.json\", async (unblock, unblockFailing) => {\n                try {\n                    const { projectPath, projectData } = await this.environment.database.Project.initialize(project, \"update-table\");\n                    if (!(table in projectData.schema.tables)) {\n                        throw new Error(\"Parameter «table» must exist as table in schema in order to «update-table»\");\n                    }\n                    // @NOTE: never alter protectors through UpdateTable operation.\n                    delete attributes.hasProtectors;\n                    const previousProtectors = projectData.schema.tables[table].attributes.hasProtectors;\n                    projectData.schema.tables[table] = {\n                        attributes: Object.assign({}, this.environment.database.constructor.DEFAULT_TABLE_ATTRIBUTES, attributes),\n                        properties: Object.assign({}, this.environment.database.constructor.DEFAULT_TABLE_PROPERTIES, properties),\n                        columns: projectData.schema.tables[table].columns\n                    };\n                    if(previousProtectors) {\n                        projectData.schema.tables[table].hasProtectors = previousProtectors;\n                    }\n                    await this.environment.utils.dehydrateJSON(projectPath, projectData);\n                    unblock();\n                } catch (error) {\n                    unblockFailing(error);\n                }\n            });\n            // @TODO: apply triggers\n            return { message: \"Operation «update-table» successfully achieved\", table };\n        } catch (error) {\n            this.environment.utils.debugError(\"UpdateTable.execute\", error, true);\n        }\n    }\n\n}\n\nmodule.exports = UpdateTable;";
fs.writeFileSync(node_72, node_contents_72, "utf8");

