"attributes\": {\n                    \"hasDescription\": \"It stores groups that users can belong to.\",\n                    \"hasProtectors\": [{\n                        \"id\": \"ForbidItemPersister\",\n                        \"fixed\": true,\n                        \"parameters\": {\n                            \"Allowed user column\": null,\n                            \"Allowed privileges\": \"to administrate\"\n                        }\n                    }]\n                },\n                \"columns\": {\n                    \"name\": {\n                        \"attributes\": {\n                            \"isUnique\": true,\n                            \"isType\": \"string\",\n                            \"isSubtype\": null,\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": 1,\n                            \"hasMaximum\": 100,\n                            \"hasPattern\": false,\n                            \"hasPatternErrorMessage\": false,\n                            \"hasDescription\": \"It represents the name of the group\"\n                        }\n                    },\n                    \"description\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"string\",\n                            \"isSubtype\": null,\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": 1,\n                            \"hasMaximum\": 1000,\n                            \"hasPattern\": false,\n                            \"hasPatternErrorMessage\": false,\n                            \"hasDescription\": \"It represents the description of the group\"\n                        }\n                    },\n                    \"privileges\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"list\",\n                            \"isSubtype\": null,\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": \"privileges\",\n                            \"isNullable\": true,\n                            \"hasDefault\": [],\n                            \"hasDescription\": \"It represents the privileges the group has by itself\"\n                        }\n                    },\n                    \"created_at\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"time\",\n                            \"isSubtype\": \"on_created\",\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": true,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": false,\n                            \"hasMaximum\": false,\n                            \"hasDescription\": \"It represents the moment the session was created\"\n                        }\n                    },\n                    \"updated_at\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"time\",\n                            \"isSubtype\": \"on_updated\",\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": true,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": false,\n                            \"hasMaximum\": false,\n                            \"hasDescription\": \"It represents the moment the session was lastly updated\"\n                        }\n                    }\n                }\n            },\n            \"privileges\": {\n                \"attributes\": {\n                    \"hasDescription\": \"It stores privileges that users and groups can own.\",\n                    \"hasProtectors\": [{\n                        \"id\": \"ForbidItemPersister\",\n                        \"fixed\": true,\n                        \"parameters\": {\n                            \"Allowed user column\": null,\n                            \"Allowed privileges\": \"to administrate\"\n                        }\n                    }]\n                },\n                \"columns\": {\n                    \"name\": {\n                        \"attributes\": {\n                            \"isUnique\": true,\n                            \"isType\": \"string\",\n                            \"isSubtype\": null,\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": 1,\n                            \"hasMaximum\": 100,\n                            \"hasPattern\": false,\n                            \"hasPatternErrorMessage\": false,\n                            \"hasDescription\": \"It represents the name of the privilege\"\n                        }\n                    },\n                    \"description\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"string\",\n                            \"isSubtype\": null,\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": 1,\n                            \"hasMaximum\": 1000,\n                            \"hasPattern\": false,\n                            \"hasPatternErrorMessage\": false,\n                            \"hasDescription\": \"It represents the description of the privilege\"\n                        }\n                    },\n                    \"created_at\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"time\",\n                            \"isSubtype\": \"on_created\",\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": true,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": false,\n                            \"hasMaximum\": false,\n                            \"hasDescription\": \"It represents the moment the privilege was created\"\n                        }\n                    },\n                    \"updated_at\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"time\",\n                            \"isSubtype\": \"on_updated\",\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": true,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": false,\n                            \"hasMaximum\": false,\n                            \"hasDescription\": \"It represents the moment the privilege was lastly updated\"\n                        }\n                    }\n                }\n            },\n            \"sessions\": {\n                \"attributes\": {\n                    \"hasDescription\": \"It stores alive user sessions of the app.\",\n                    \"hasProtectors\": [{\n                        \"id\": \"ForbidItemPersister\",\n                        \"fixed\": true,\n                        \"parameters\": {\n                            \"Allowed user column\": null,\n                            \"Allowed privileges\": \"to administrate\"\n                        }\n                    }, {\n                        \"id\": \"ForbidItemViewer\",\n                        \"fixed\": true,\n                        \"parameters\": {\n                            \"Forbid fields\": \"token\",\n                            \"Allowed user column\": \"user\",\n                            \"Allowed privileges\": \"to administrate\"\n                        }\n                    }, {\n                        \"id\": \"ForbidFieldsViewer\",\n                        \"fixed\": true,\n                        \"parameters\": {\n                            \"Forbid fields\": \"token\",\n                            \"Allowed user column\": null,\n                            \"Allowed privileges\": \"to administrate\"\n                        }\n                    }]\n                },\n                \"columns\": {\n                    \"user\": {\n                        \"attributes\": {\n                            \"isUnique\": true,\n                            \"isType\": \"object\",\n                            \"isSubtype\": null,\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": \"users\",\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasDescription\": \"It represents the user that belongs this session to\"\n                        }\n                    },\n                    \"token\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"string\",\n                            \"isSubtype\": \"token\",\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasMinimum\": 100,\n                            \"hasMaximum\": 100,\n                            \"hasPattern\": false,\n                            \"hasPatternErrorMessage\": false,\n                            \"hasDescription\": \"It represents the token this session uses to authenticate itself\"\n                        }\n                    },\n                    \"created_at\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"time\",\n                            \"isSubtype\": \"on_created\",\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasDescription\": \"It represents the moment the session was created\"\n                        }\n                    },\n                    \"updated_at\": {\n                        \"attributes\": {\n                            \"isUnique\": false,\n                            \"isType\": \"time\",\n                            \"isSubtype\": \"on_updated\",\n                            \"isEncrypted\": false,\n                            \"isReferenceOf\": null,\n                            \"isNullable\": false,\n                            \"hasDefault\": null,\n                            \"hasDescription\": \"It represents the moment the session was lastly updated\"\n                        }\n                    }\n                }\n            }\n        }\n    }\n}";
