const node_152 = path.resolve(baseDirectory, ".", "test", "monolith", "inrow", "040.Processes.js");
const node_contents_152 = "module.exports = async function (commonData) {\n    const { requester, utils, tester } = commonData;\n    try {\n\n        tester.startTest(\"Processes\");\n\n        const accessProcesses01 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"process\",\n            process: \"restologia.official.org/common/ping\"\n        }, {}, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Process is accessible when it is enabled\");\n\n        // utils.dieStringify(accessProcesses01.response);\n\n        if (!utils.check.that(accessProcesses01.response.status).equals(\"success\")) throw new Error(\"01.0\");\n        if (!utils.check.that(accessProcesses01.response.data.message).equals(\"Operation «process» successfully achieved\")) throw new Error(\"01.1\");\n        if (!utils.check.that(accessProcesses01.response.data.operation).equals(\"restologia.official.org/common/ping\")) throw new Error(\"01.2\");\n\n        const accessProcesses02 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"process\",\n            process: \"restologia.official.org/common/os\"\n        }, {}, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Process is NOT accessible when it is NOT enabled\");\n\n        if (!utils.check.that(accessProcesses02.response.status).equals(\"error\")) throw new Error(\"02.0\");\n        if (!utils.check.that(accessProcesses02.response.error.message).equals(\"Required parameter «process» to refer to an enabled process\")) throw new Error(\"02.1\");\n\n        const accessProcesses03 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"process\",\n            process: \"restologia.official.org/common/unexistent\"\n        }, {}, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Process is NOT accessible when it is DOES NOT exist\");\n\n        if (!utils.check.that(accessProcesses03.response.status).equals(\"error\")) throw new Error(\"03.0\");\n        if (!utils.check.that(accessProcesses03.response.error.message).equals(\"Required parameter «process» to be an identifiable process\")) throw new Error(\"03.1\");\n\n        tester.passTest(\"Processes\");\n\n    } catch (error) {\n        tester.failTest(\"Processes\");\n        throw error;\n    }\n};";
fs.writeFileSync(node_152, node_contents_152, "utf8");

const node_153 = path.resolve(baseDirectory, ".", "test", "monolith", "inrow", "101.Prepare-e-shop.js");
const node_contents_153 = "module.exports = async function (commonData) {\n    const { requester, utils, tester } = commonData;\n    try {\n\n        tester.startTest(\"Prepare e-shop\");\n\n        const addTableResponse01 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"add-table\",\n        }, {\n            table: \"charts\",\n            attributes: JSON.stringify({\n                hasDescription: \"It represents charts of users\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Prepare e-shop: add «charts» table\");\n\n        if (!utils.check.that(addTableResponse01.response.data.message).equals(\"Operation «add-table» successfully achieved\")) throw new Error(\"1.0\");\n\n        const addColumnResponse01 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"add-column\",\n        }, {\n            table: \"charts\",\n            column: \"user\",\n            attributes: JSON.stringify({\n                isUnique: true,\n                isType: \"object\",\n                isSubtype: null,\n                isEncrypted: false,\n                isReferenceOf: \"users\",\n                isNullable: false,\n                hasDefault: null,\n                hasMinimum: false,\n                hasMaximum: false,\n                hasPattern: false,\n                hasPatternErrorMessage: false,\n                hasDescription: \"It represents charts of users\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Prepare e-shop: add «charts.user» column\");\n\n        if (!utils.check.that(addColumnResponse01.response.data.message).equals(\"Operation «add-column» successfully achieved\")) throw new Error(\"2.0\");\n\n        const addColumnResponse02 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"add-column\",\n        }, {\n            table: \"charts\",\n            column: \"details\",\n            attributes: JSON.stringify({\n                isUnique: false,\n                isType: \"string\",\n                isSubtype: null,\n                isEncrypted: false,\n                isReferenceOf: null,\n                isNullable: true,\n                hasDefault: \"\",\n                hasMinimum: false,\n                hasMaximum: false,\n                hasPattern: false,\n                hasPatternErrorMessage: false,\n                hasDescription: \"It represents notes attached to the charts of users\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Prepare e-shop: add «charts.details» column\");\n\n        if (!utils.check.that(addColumnResponse02.response.data.message).equals(\"Operation «add-column» successfully achieved\")) throw new Error(\"3.0\");\n\n        const addTableResponse02 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"add-table\",\n        }, {\n            table: \"products_of_charts\",\n            attributes: JSON.stringify({\n                hasDescription: \"It represents products assigned to charts of users\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Prepare e-shop: add «products_of_charts» table\");\n\n        if (!utils.check.that(addTableResponse02.response.data.message).equals(\"Operation «add-table» successfully achieved\")) throw new Error(\"4.0\");\n\n        const addColumnResponse03 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"add-column\",\n        }, {\n            table: \"products_of_charts\",\n            column: \"chart\",\n            attributes: JSON.stringify({\n                isUnique: false,\n                isType: \"object\",\n                isSubtype: null,\n                isEncrypted: false,\n                isReferenceOf: \"charts\",\n                isNullable: false,\n                hasDefault: null,\n                hasMinimum: false,\n                hasMaximum: false,\n                hasPattern: false,\n                hasPatternErrorMessage: false,\n                hasDescription: \"It represents the chart to which the product belongs to\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Prepare e-shop: add «products_of_charts.chart» column\");\n\n        if (!utils.check.that(addColumnResponse03.response.data.message).equals(\"Operation «add-column» successfully achieved\")) throw new Error(\"5.0\");\n\n        const addColumnResponse04 = await requester(\"POST\", \"http://127.0.0.1:9999\", {\n            project: \"Empresa_z\",\n            operation: \"add-column\",\n        }, {\n            table: \"products_of_charts\",\n            column: \"product\",\n            attributes: JSON.stringify({\n                isUnique: false,\n                isType: \"object\",\n                isSubtype: null,\n                isEncrypted: false,\n                isReferenceOf: \"products\",\n                isNullable: false,\n                hasDefault: null,\n                hasMinimum: false,\n                hasMaximum: false,\n                hasPattern: false,\n                hasPatternErrorMessage: false,\n                hasDescription: \"It represents the product added into the chart\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.sessionToken,\n        }, true, true, \"Prepare e-shop: add «products_of_charts.product» column\");\n\n        if (!utils.check.that(addColumnResponse04.response.data.message).equals(\"Operation «add-column» successfully achieved\")) throw new Error(\"6.0\");\n\n        tester.passTest(\"Prepare e-shop\");\n\n    } catch (error) {\n        tester.failTest(\"Prepare e-shop\");\n        throw error;\n    }\n};";
