const node_220 = path.resolve(baseDirectory, ".", "test", "pluralith", "inrow", "005.Create-projects.js");
const node_contents_220 = "module.exports = async function (commonData) {\n    const { requester, utils, tester } = commonData;\n    try {\n\n        tester.startTest(\"Create projects\");\n\n        const response01 = await requester(\"POST\", \"http://127.0.0.1:9980\", {\n            operation: \"create-project\",\n        }, {\n            user: \"carlosjimenohernandez\",\n            password: \"Carlos.Jimeno.Hernandez.9876543210\",\n            project: \"Identification\",\n            administrator_name: \"auth_admin\",\n            administrator_password: \"auth_admin\",\n            administrator_email: \"auth_admin@correo.com\",\n        }, {}, true, true, \"Create project «Identification»\");\n\n        if (!utils.check.that(response01.response.status).equals(\"success\")) throw new Error(1);\n\n        const response02 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            operation: \"create-project\",\n        }, {\n            user: \"carlosjimenohernandez\",\n            password: \"Carlos.Jimeno.Hernandez.9876543210\",\n            project: \"Products\",\n            administrator_name: \"products_admin\",\n            administrator_password: \"products_admin\",\n            administrator_email: \"products_admin@correo.com\",\n            schema_attributes: {\n                isAuthenticatedBy: {\n                    url: \"http://127.0.0.1:9980\",\n                    project: \"Identification\"\n                }\n            }\n        }, {}, true, true, \"Create project «Identification»\");\n\n        if (!utils.check.that(response02.response.status).equals(\"success\")) throw new Error(2);\n\n        const response03 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            operation: \"create-project\",\n        }, {\n            user: \"carlosjimenohernandez\",\n            password: \"Carlos.Jimeno.Hernandez.9876543210\",\n            project: \"Charts\",\n            administrator_name: \"charts_admin\",\n            administrator_password: \"charts_admin\",\n            administrator_email: \"charts_admin@correo.com\",\n            schema_attributes: {\n                isAuthenticatedBy: {\n                    url: \"http://127.0.0.1:9980\",\n                    project: \"Identification\"\n                }\n            }\n        }, {}, true, true, \"Create project «Charts»\");\n\n        if (!utils.check.that(response03.response.status).equals(\"success\")) throw new Error(3);\n\n        const productsProjectJson = JSON.parse(require(\"fs\").readFileSync(commonData.serversPath + \"/products/src/data/projects/Products/project.json\").toString());\n        console.log(productsProjectJson);\n        if (!utils.check.that(typeof productsProjectJson.schema.attributes.isAuthenticatedBy).equals(\"object\")) throw new Error(\"4: isAuthenticatedBy is not an object\");\n        if (!utils.check.that(productsProjectJson.schema.attributes.isAuthenticatedBy.url).equals(\"http://127.0.0.1:9980\")) throw new Error(5);\n        if (!utils.check.that(productsProjectJson.schema.attributes.isAuthenticatedBy.project).equals(\"Identification\")) throw new Error(6);\n\n        const chartsProjectJson = JSON.parse(require(\"fs\").readFileSync(commonData.serversPath + \"/charts/src/data/projects/Charts/project.json\").toString());\n        if (!utils.check.that(typeof chartsProjectJson.schema.attributes.isAuthenticatedBy).equals(\"object\")) throw new Error(7);\n        if (!utils.check.that(chartsProjectJson.schema.attributes.isAuthenticatedBy.url).equals(\"http://127.0.0.1:9980\")) throw new Error(8);\n        if (!utils.check.that(chartsProjectJson.schema.attributes.isAuthenticatedBy.project).equals(\"Identification\")) throw new Error(9);\n\n        tester.passTest(\"Create projects\");\n\n    } catch (error) {\n        tester.failTest(\"Create projects\");\n        throw error;\n    }\n};\n";
fs.writeFileSync(node_220, node_contents_220, "utf8");

const node_221 = path.resolve(baseDirectory, ".", "test", "pluralith", "inrow", "006.01.Login-externally.js");
const node_contents_221 = "module.exports = async function (commonData) {\n    const { requester, utils, tester } = commonData;\n    try {\n\n        tester.startTest(\"Login externally\");\n\n        /////////////////////////////////////////////////////////////////////////////////////////\n        // Login auth admin:\n\n        const response01 = await requester(\"POST\", \"http://127.0.0.1:9980\", {\n            operation: \"login\",\n            project: \"Identification\",\n        }, {\n            user: \"auth_admin\",\n            password: \"auth_admin\",\n        }, {}, true, true, \"Login 'auth_admin'\");\n\n        if (!utils.check.that(response01.response.status).equals(\"success\")) throw new Error(1);\n\n        commonData.$authAdminToken = response01.response.data.session.token;\n\n        /////////////////////////////////////////////////////////////////////////////////////////\n        // Create products admin user on auth system:\n\n        const response02_1 = await requester(\"POST\", \"http://127.0.0.1:9980\", {\n            operation: \"insert\",\n            project: \"Identification\",\n        }, {\n            table: \"users\",\n            value: JSON.stringify({\n                name: \"products_admin_external\",\n                password: \"products_admin_external\",\n                email: \"products_admin@correo.com\",\n                groups: [],\n                privileges: []\n            })\n        }, {\n            authorization: commonData.$authAdminToken\n        }, true, true, \"Add 'products_admin' using 'auth_admin' authentication\");\n\n        if (!utils.check.that(response02_1.response.status).equals(\"success\")) throw new Error(\"2.1\");\n\n        /////////////////////////////////////////////////////////////////////////////////////////\n        // Create charts admin user on auth system:\n\n        const response02_2 = await requester(\"POST\", \"http://127.0.0.1:9980\", {\n            operation: \"insert\",\n            project: \"Identification\",\n        }, {\n            table: \"users\",\n            value: JSON.stringify({\n                name: \"charts_admin_external\",\n                password: \"charts_admin_external\",\n                email: \"charts_admin@correo.com\",\n                groups: [],\n                privileges: []\n            })\n        }, {\n            authorization: commonData.$authAdminToken\n        }, true, true, \"Add 'products_admin' using 'auth_admin' authentication\");\n\n        if (!utils.check.that(response02_2.response.status).equals(\"success\")) throw new Error(\"2.2\");\n\n        /////////////////////////////////////////////////////////////////////////////////////////\n        // Login with products admin on Products (so, externally):\n\n        const response03 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            operation: \"login\",\n            project: \"Products\",\n        }, {\n            user: \"products_admin_external\",\n            password: \"products_admin_external\",\n        }, {}, true, true, \"Login 'products_admin' (externally)\");\n\n        if (!utils.check.that(response03.response.status).equals(\"success\")) throw new Error(3);\n\n        commonData.$productsAdminToken = response03.response.data.session.token;\n\n        /////////////////////////////////////////////////////////////////////////////////////////\n        // Login with products admin on Products (so, externally):\n\n        const response04 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            operation: \"login\",\n            project: \"Charts\",\n        }, {\n            user: \"charts_admin_external\",\n            password: \"charts_admin_external\",\n        }, {}, true, true, \"Login 'charts_admin' (externally)\");\n\n        if (!utils.check.that(response04.response.status).equals(\"success\")) throw new Error(4);\n\n        commonData.$chartsAdminToken = response04.response.data.session.token;\n\n        tester.passTest(\"Login externally\");\n\n    } catch (error) {\n        tester.failTest(\"Login externally\");\n        throw error;\n    }\n};\n";
fs.writeFileSync(node_221, node_contents_221, "utf8");

const node_222 = path.resolve(baseDirectory, ".", "test", "pluralith", "inrow", "006.02.Define-schemas.js");
const node_contents_222 = "module.exports = async function (commonData) {\n    const { requester, utils, tester } = commonData;\n    try {\n\n        tester.startTest(\"Define schemas\");\n\n        ////////////////////////////////////////////////////////////////////////////////////////////\n        // Define «Products.products» table:\n\n        const response01_00 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-table\",\n        }, {\n            table: \"products\",\n            attributes: JSON.stringify({}),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products» table on «Products»\");\n\n        if (!utils.check.that(response01_00.response.status).equals(\"success\")) throw new Error(\"1.0\");\n\n        const response01_01 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-column\",\n        }, {\n            table: \"products\",\n            column: \"name\",\n            attributes: JSON.stringify({\n                hasDescription: \"The name of the product\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products.*» column on «Products»\");\n\n        if (!utils.check.that(response01_01.response.status).equals(\"success\")) throw new Error(\"1.1\");\n\n        const response01_02 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-column\",\n        }, {\n            table: \"products\",\n            column: \"price\",\n            attributes: JSON.stringify({\n                hasDescription: \"The price of the product\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products.*» column on «Products»\");\n\n        if (!utils.check.that(response01_02.response.status).equals(\"success\")) throw new Error(\"1.2\");\n\n        const response01_03 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-column\",\n        }, {\n            table: \"products\",\n            column: \"description\",\n            attributes: JSON.stringify({\n                hasDescription: \"The description of the product\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products.*» column on «Products»\");\n\n        if (!utils.check.that(response01_03.response.status).equals(\"success\")) throw new Error(\"1.3\");\n\n        const response01_04 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-column\",\n        }, {\n            table: \"products\",\n            column: \"details\",\n            attributes: JSON.stringify({\n                hasDescription: \"The details attached to the product\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products.*» column on «Products»\");\n\n        if (!utils.check.that(response01_04.response.status).equals(\"success\")) throw new Error(\"1.4\");\n\n        const response01_05 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-column\",\n        }, {\n            table: \"products\",\n            column: \"categories\",\n            attributes: JSON.stringify({\n                hasDescription: \"The categories associated to the product\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products.*» column on «Products»\");\n\n        if (!utils.check.that(response01_05.response.status).equals(\"success\")) throw new Error(\"1.5\");\n\n        // This binding is to keep external consistency with «Charts.charts.products»:\n\n        const response01_06 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-table\",\n        }, {\n            table: \"charts\",\n            attributes: JSON.stringify({\n                isExternalizedBy: {\n                    server: \"Charts Server\",\n                    host: \"http://127.0.0.1:9982\",\n                    project: \"Charts\",\n                    table: \"charts\",\n                }\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «charts» table on «Products»\");\n\n        if (!utils.check.that(response01_06.response.status).equals(\"success\")) throw new Error(\"1.6\");\n\n        const response01_07 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            project: \"Products\",\n            operation: \"add-column\",\n        }, {\n            table: \"charts\",\n            column: \"products\",\n            attributes: JSON.stringify({\n                isType: \"list\",\n                isReferenceOf: \"products\"\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products.*» column on «Products»\");\n\n        if (!utils.check.that(response01_07.response.status).equals(\"success\")) throw new Error(\"1.7\");\n\n        ////////////////////////////////////////////////////////////////////////////////////////////\n        // Define «Charts.products» table:\n\n        let response02 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            project: \"Charts\",\n            operation: \"add-table\",\n        }, {\n            table: \"products\",\n            attributes: JSON.stringify({\n                isExternalizedBy: {\n                    server: \"Products Server\",\n                    host: \"http://127.0.0.1:9981\",\n                    project: \"Products\",\n                    table: \"products\",\n                }\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «products» table on «Charts»\");\n\n        if (!utils.check.that(response02.response.status).equals(\"success\")) throw new Error(\"2.0\");\n\n        ////////////////////////////////////////////////////////////////////////////////////////////\n        // Define «Charts.users» table:\n\n        const response03 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            project: \"Charts\",\n            operation: \"add-table\",\n        }, {\n            table: \"users\",\n            attributes: JSON.stringify({\n                isExternalizedBy: {\n                    host: \"http://127.0.0.1:9980\",\n                    server: \"Authentication Server\",\n                    project: \"Identification\",\n                    table: \"users\",\n                }\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «users» table on «Charts»\");\n\n        if (!utils.check.that(response03.response.status).equals(\"success\")) throw new Error(\"3.0\");\n        \n        ////////////////////////////////////////////////////////////////////////////////////////////\n        // Define «Charts.charts» table:\n\n        const response04_01 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            project: \"Charts\",\n            operation: \"add-table\",\n        }, {\n            table: \"charts\",\n            attributes: JSON.stringify({\n                hasMultipleUniqueKeys: []\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «charts» table on «Charts»\");\n\n        if (!utils.check.that(response04_01.response.status).equals(\"success\")) throw new Error(\"4.1\");\n\n        const response04_02 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            project: \"Charts\",\n            operation: \"add-column\",\n        }, {\n            table: \"charts\",\n            column: \"products\",\n            attributes: JSON.stringify({\n                isType: \"list\",\n                isReferenceOf: \"products\",\n                hasDescription: \"The products added to the chart\",\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «charts.*» column on «Charts»\");\n\n        if (!utils.check.that(response04_02.response.status).equals(\"success\")) throw new Error(\"4.2\");\n\n        const response04_03 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            project: \"Charts\",\n            operation: \"add-column\",\n        }, {\n            table: \"charts\",\n            column: \"owner\",\n            attributes: JSON.stringify({\n                isType: \"object\",\n                isUnique: true,\n                isReferenceOf: \"users\",\n                hasDescription: \"The user that owns the chart\",\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «charts.*» column on «Charts»\");\n\n        if (!utils.check.that(response04_03.response.status).equals(\"success\")) throw new Error(\"4.3\");\n\n        const response04_04 = await requester(\"POST\", \"http://127.0.0.1:9982\", {\n            project: \"Charts\",\n            operation: \"add-column\",\n        }, {\n            table: \"charts\",\n            column: \"notes\",\n            attributes: JSON.stringify({\n                isType: \"text\",\n                hasDescription: \"Notes associated to the chart\",\n            }),\n            properties: JSON.stringify({}),\n        }, {\n            authorization: commonData.$authAdminToken,\n        }, true, true, \"Add «charts.*» column on «Charts»\");\n\n        if (!utils.check.that(response04_04.response.status).equals(\"success\")) throw new Error(\"4.4\");\n\n        tester.passTest(\"Define schemas\");\n\n    } catch (error) {\n        tester.failTest(\"Define schemas\");\n        throw error;\n    }\n};\n";
