const node_223 = path.resolve(baseDirectory, ".", "test", "pluralith", "inrow", "006.03.Fill-schemas.js");
const node_contents_223 = "module.exports = async function (commonData) {\n    const { requester, utils, tester } = commonData;\n    try {\n\n        tester.startTest(\"Fill schemas\");\n\n        ////////////////////////////////////////////////////////////////////////////////////////////\n        // Define «Products.products» table:\n\n        const products = [{\n            name: \"Product one\",\n            price: \"100€\",\n            description: \"The «Product one» is awesome.\",\n            details: \"It is the one.\",\n            categories: \"numbers;one\"\n        }, {\n            name: \"Product two\",\n            price: \"200€\",\n            description: \"The «Product two» is awesome.\",\n            details: \"It is the two.\",\n            categories: \"numbers;two\"\n        }, {\n            name: \"Product three\",\n            price: \"300€\",\n            description: \"The «Product three» is awesome.\",\n            details: \"It is the three.\",\n            categories: \"numbers;three\"\n        }, {\n            name: \"Product four\",\n            price: \"400€\",\n            description: \"The «Product four is awesome.\",\n            details: \"It is the four.\",\n            categories: \"numbers;four\"\n        }, {\n            name: \"Product five\",\n            price: \"500€\",\n            description: \"The «Product five» is awesome.\",\n            details: \"It is the five.\",\n            categories: \"numbers;five\"\n        }];\n\n        for(let index = 0; index < products.length; index++) {\n            const product = products[index];\n\n            const productResponse = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n                project: \"Products\",\n                operation: \"insert\",\n            }, {\n                table: \"products\",\n                value: JSON.stringify(product)\n            }, {\n                authorization: commonData.$productsAdminToken,\n            }, true, true, \"Add «products» to «Products.products»\");\n    \n            if (!utils.check.that(productResponse.response.status).equals(\"success\")) throw new Error(\"1.1\");\n            \n        }\n\n\n        tester.passTest(\"Fill schemas\");\n\n    } catch (error) {\n        tester.failTest(\"Fill schemas\");\n        throw error;\n    }\n};\n";
fs.writeFileSync(node_223, node_contents_223, "utf8");

const node_224 = path.resolve(baseDirectory, ".", "test", "pluralith", "inrow", "007.Authenticate-externally.js");
const node_contents_224 = "module.exports = async function (commonData) {\n    const { requester, utils, tester } = commonData;\n    try {\n\n        tester.startTest(\"Authenticate externally\");\n\n        const response01 = await requester(\"POST\", \"http://127.0.0.1:9981\", {\n            operation: \"authenticate\",\n            project: \"Products\",\n        }, {}, {\n            authorization: commonData.$productsAdminToken\n        }, true, true, \"Authenticate 'products_admin_externally'\");\n\n        if (!utils.check.that(response01.response.status).equals(\"success\")) throw new Error(1);\n\n        if (!utils.check.that(typeof response01.response.data.authentication).equals(\"object\")) throw new Error(1);\n        if (!utils.check.that(typeof response01.response.data.authentication.user).equals(\"object\")) throw new Error(2);\n        if (!utils.check.that(typeof response01.response.data.authentication.groups).equals(\"object\")) throw new Error(3);\n        if (!utils.check.that(typeof response01.response.data.authentication.privileges).equals(\"object\")) throw new Error(4);\n        if (!utils.check.that(typeof response01.response.data.authentication.session).equals(\"object\")) throw new Error(5);\n        if (!utils.check.that(typeof response01.response.data.authentication.project).equals(\"string\")) throw new Error(6);\n\n        tester.passTest(\"Authenticate externally\");\n\n    } catch (error) {\n        tester.failTest(\"Authenticate externally\");\n        throw error;\n    }\n};\n";
